INSERT INTO `creatures` VALUES (1,'amazon','Amazons','Amazons are communities of martial women who have erected some hideouts\r\nin the swamps in the east of Tibia. They attack every intruder of their\r\nsphere vigorously and cut off the heads of their victims in order to\r\nkeep them as some kind of trophies. They are not only quite strong in\r\nclose combat but are also able to throw knives with deadly precision.<BR>\n<BR>Amazons have 110 hitpoints. \nIt takes 390 mana to summon or convince these creatures.\n<BR><BR>Amazons yield 180 experience points. They carry sabres, brown breads, gold coins, leather armors, daggers, skulls, and sometimes other items with them.'),(2,'ancientscarab','Ancient Scarabs','The ancient scarab is ancient indeed - it is said that there are specimen\r\nthat are aeons old. Rumours say that unless killed, a scarab will not die\r\nof old age but continue to grow and grow to enormous proportions. Their\r\nusual pace of movement is not impressively fast, but they are capable of\r\ndoing sudden charges to catch their opponents off guard. Even more\r\ndangerous, their poison is strong enough to allow these creatures to emit\r\nlarge clouds of stinking death and mayhem around themselves. Ancient\r\nscarabs are said to be the keepers of mysterious secrets swallowed by the\r\nsands long time ago. So don\'t be surprised if some of them might display\r\neven more cunning tactics and devastating magic.<BR>\n<BR>Ancient Scarabs have 1000 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Ancient Scarabs yield 2160 experience points. They carry gold coins, magic light wands, plate armors, and sometimes other items with them.'),(3,'assassin','Assassins','Merciless and lethal, the assassin stands for treacherous surprise\r\nattacks. Although there are a lot of thugs, bandits and murderers that\r\nroam the realm, the assassin is one of the few who made a real profession\r\nout of murder. Usually organised in small organisations, assassins are\r\ntrained in the arts of fighting dirty tricks, backstabbing and stalking.\r\nAlthough they are formidable fighters, those hirable murderers prefer\r\nsneak attacks on unsuspecting victims which they attack with all kinds of\r\ndirty tricks to gain an advantage. Depending on their current mission, the\r\nassassins work alone or in small hit squads. They are rarely encountered\r\nin greater numbers except by those that are unfortunate enough to stumble\r\non their hideouts.<BR>\n<BR>Assassins have 175 hitpoints. \nIt takes 450 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Assassins yield 315 experience points. They carry torches, gold coins, knives, and sometimes other items with them.'),(4,'badger','Badgers','These creatures are a common sight in Tibian forests and plains. Although\r\nthey are usually quite shy, these animals are extremely territorial. Ready\r\nto attack any intruders regardless of their size, the badger can easily\r\nbecome a nasty surprise to the unsuspecting traveller.<BR>\n<BR>Badgers have 23 hitpoints. \nIt takes 200 mana to summon or convince these creatures.\n<BR><BR>Badgers yield 15 experience points. They carry meat and worms with them.'),(5,'bandit','Bandits','The tale of the noble bandit that takes from the rich and gives to the poor\r\nis far away from reality. The usual bandit does not care whom he is robbing\r\nas long as he is able to gain something of value for himself. Actually in\r\nmost cases, the poor are those that are worst prepared to defend themselves\r\nand so have become the preferred victims of bandits. Bandits are armed with\r\na variety of weapons, their armour has usually been plundered somewhere.\r\nAlways avoiding the city guards, they set up their hideouts in the\r\nwilderness, often close to streets where they are feared as highwaymen.\r\nInvolved in all kinds of illegal activities, they can be found in the\r\nservice of all kind of persons that want some dirty work performed. Some\r\neven stand in the service of some head bandit who has managed to suppress\r\nsome remote area or village.<BR>\n<BR>Bandits have 245 hitpoints. \nIt takes 450 mana to summon or convince these creatures.\n<BR><BR>Bandits yield 195 experience points. They carry gold coins, axes, maces, brass shields, leather legs, meat, and sometimes other items with them.'),(6,'banshee','Banshees','The Banshee is an undead creature of sheer terror. Legend has it she \r\nonce was a mortal woman of great beauty who has killed herself over some \r\nlong forgotten grievance. Death refused her sacrifice and sent her back, \r\ncursed and distorted. Now the Banshee is a ghastly sight to behold. Her \r\nbody is not ethereal like that of a ghost, but her burning gaze and the \r\nwithering look of infinite pain in her face strike terror in every \r\nmortal\'s heart. Even worse than her fearsome looks, however, is her \r\nunworldly song. The Banshee\'s wail is a melody of pure death which \r\ndrains her unfortunate victims of all life and hope. Few mortals who \r\nhave encountered a Banshee have lived to tell the tale.<BR>\n<BR>Banshees have 1000 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Banshees yield 2700 experience points. They carry candlesticks, dirty capes, gold coins, simple dresses, and sometimes other items with them.'),(7,'bat','Bats','Often encountered in caves and ruins, bats are often seen as a bad omen.\r\nBeing little stronger than a rat, they are rather a nuisance than a threat\r\nto an experienced adventurer. Their diet usually consists of small animals\r\nand their rare attacks on people mainly happen out of self-defence. Bats\r\noften form large swarms, and it is slightly more dangerous to face such a\r\nswarm than a single exemplar. Bats can be found almost everywhere as long\r\nas there is some dark place close-by where they can breed and sleep.<BR>\n<BR>Bats have 30 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Bats yield 30 experience points. They carry nothing with them.'),(8,'bear','Bears','Bears live in the holes and forests of Tibia. They are pacific animals,\r\nbut they can get quite aggressive when you enter their habitat.\r\nTheir stroke can be very strong, but as bears are slow you should be\r\nable to flee. It is recommended to attack bears with distance fighting\r\nweapons.<BR>\n<BR>Bears have 80 hitpoints. \nIt takes 300 mana to summon or convince these creatures.\n<BR><BR>Bears yield 69 experience points. They carry meat, ham, and sometimes other items with them.'),(9,'behemoth','Behemoths','Behemoths are giant monsters that live in the ancient town deep below Edron.\r\nThey look a bit like cross-breeds of humans and bulls and even talk in human\r\nlanguage, but nobody knows yet where they come from. Although they are of\r\nminor intelligence, they are very strong fighters and throw huge stones at\r\ntheir opponents. They are able to sense invisible creatures.<BR>\n<BR>Behemoths have 4000 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Behemoths yield 7500 experience points. They carry amphoras, gold coins, double axes, crowbars, meat, and sometimes other items with them.'),(10,'beholder','Beholders','Beholders are slimy monsters with several tentacles that live deep in \r\nthe dungeons of Tibia. They attack at sight and use their magic powers\r\nto shoot missiles. Moreover, they summon skeletons which try to surround\r\nthe victim. They can sense invisible adventures.\r\nYou should try to eliminate the beholder first, since all of its summons \r\nwill also die when the beholder is killed. Magicians can use firebombs to hurt \r\nseveral opponents at once.<BR>\n<BR>Beholders have 260 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Beholders yield 510 experience points. They carry gold coins and sometimes other items with them.'),(11,'blackknight','Black Knights','Black Knights are deserted knights of the King\'s army. They live deep\r\nin the swamps of Tibia and attack every intruder of their sphere.\r\nWell equipped they are very strong in close combat and use their\r\nspears for distance fighting.<BR>\n<BR>Black Knights have 1800 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Black Knights yield 4800 experience points. They carry brass legs, brown breads, gold coins, halberds, plate armors, ropes, spears, steel helmets, two handed swords, and sometimes other items with them.'),(12,'bluedjinn','Blue Djinns','Although the Blue Djinns are considered entities of goodness they tend\r\nto guard their secrets well from nosy explorers, diligently performing\r\nany task they accepted. Being highly magical creatures they are masters\r\nof illusion and transformation. Djinns are known for their spellcraft and\r\nfairy-tales commonly narrate about djinns granting people wishes. Magicians\r\noften mock this idea, arguing that only djinns bound by powerful magic and\r\nsummonings would feel obliged to such duties. Be it as it may, recently\r\narosen from a deep slumber most Blue Djinns encountered are the most weak\r\nof their kind anyway. Searching the world for the servants of evil and\r\ntheir eternal nemesis, the green djinns, they still pose a threat for all\r\nwhom they suspect of being in leage with evil.<BR>\n<BR>Blue Djinns have 330 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Blue Djinns yield 570 experience points. They carry carrots, gold coins, and sometimes other items with them.'),(13,'bonebeast','Bonebeasts','The result of an unspeakable ritual that mocks the holy secrets of\r\ncreation, the bone beast is a harbinger of doom and pestilence. It is best\r\ndescribed as a hideous conglomerate of bones and rotten flesh vaguely\r\nresembling a bull. Bone beasts are often created by some unscrupulous lich,\r\nand they mindlessly obey their master\'s orders no matter what they are. More\r\noften than not, these orders include impaling one or more hapless victims on\r\none of the bone beast\'s massive horns.<BR>\n<BR>Bonebeasts have 515 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Bonebeasts yield 1740 experience points. They carry gold coins, skulls, bones, big bones, and sometimes other items with them.'),(14,'bug','Bugs','Bugs live in the forests of Tibia and are nourished mainly by carrion. \r\nHowever, they do not shrink back from killing other animals.\r\nWhen they crop up in packs, they can even become dangerous for\r\nbadly equipped adventurers.<BR>\n<BR>Bugs have 29 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Bugs yield 54 experience points. They carry gold coins and sometimes other items with them.'),(15,'butterflypurple','Butterflies','For a long time it was thought that the butterfly had extinct on the\nTibian continent. Only recently, the Tiquanda butterfly has been discovered.\nSo finally generations, who have known those beautiful creatures only from\npaintings and stories, have now a chance to see them first-hand. Somehow\nthey have managed lately to migrate from the jungle to other areas and\nhave begun to spread all over the world again.<BR>\n<BR>Butterflies have 2 hitpoints. \nThese creatures can neither be summoned nor convinced.\n<BR><BR>Butterflies yield 0 experience points. They carry nothing with them.'),(16,'carniphila','Carniphilas','This creature is neither a plant nor a beast, it is rather a mixture of\r\nboth and another oddity that the Tiquandan jungle holds in store for\r\nexplorers and settlers. Although plant-like in its looks and structure, it\r\nseems to be able to control its movements. It is carnivorous by nature and\r\nfollows almost mindlessly its greedy appetite. Its poisonous attacks\r\ndecelerate its victims and so the slow giant plant can catch up and attack\r\nwith its thorny tentacles and a maw-like blossom. The dead bodies of their\r\nvictims do not only serve as food but also as fertiliser for the plants\r\nseeds. Therefore it is advised to burn bodies who died by an attack of a\r\nCarniphila.<BR>\n<BR>Carniphilas have 255 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Carniphilas yield 450 experience points. They carry gold coins, ham, meat, and sometimes other items with them.'),(17,'caverat','Cave Rats','Cave Rats live in deep holes and in dungeons. As they are bigger and\r\nmore vicious than normal rats, they can be quite dangerous for badly\r\nequipped adventurers, especially when they crop up in packs.<BR>\n<BR>Cave Rats have 30 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Cave Rats yield 30 experience points. They carry cheese, gold coins, worms, and sometimes other items with them.'),(18,'centipede','Centipedes','The poisonous Centipede is a pest that is native of the Tiquandan jungle.\r\nSomehow a few of the creatures managed to sneak on ships and spread all\r\nover the world. Being mainly a scavenger, the Centipede rarely hunts\r\nactively for prey; but if it runs into a creature, it will attack it\r\nnonetheless. Given the fact that it does not have to kill for a living,\r\nthe Centipede is astonishingly tough and challenging in combat. Being\r\nfast and poisonous, the Centipede can be quite dangerous, and its\r\nfertility causes its appearance in large numbers. This creature seems\r\nineradicable, several extermination campaigns have already failed.\r\nWherever a carrion is laying, a Centipede is close. However, it prefers\r\nto live in caves and narrow tunnels. Mould and decay seem to attract it\r\nand not little made their homes in the sewers of the cities.<BR>\n<BR>Centipedes have 70 hitpoints. They are resistant against poison.\nIt takes 335 mana to summon or convince these creatures.\n<BR><BR>Centipedes yield 90 experience points. They carry gold coins and sometimes other items with them.'),(19,'chicken','Chickens','Chickens are domesticated animals that usually live on farms. Their eggs\r\nand their flesh makes them quite useful and neither the rumour of evil\r\nbattle chickens nor the myth of a hidden town inhabited by talking chickens\r\nturned out to be true. Chickens have accompanied mankind and other races\r\nfrom the beginning and they have spread over the world as civilisation\r\nadvanced.<BR>\n<BR>Chickens have 15 hitpoints. \nIt takes 220 mana to summon or convince these creatures.\n<BR><BR>Chickens yield 0 experience points. They carry worms and sometimes other items with them.'),(20,'cobra','Cobras','The desert-creeping Cobra has become a symbol of assasination and\r\nvenom throughout the world. Contrary to the slithery green snakes which\r\ndwell the swamps and in general prefer a moist surrounding, cobras have well\r\nadapted to the dry and hostile environment of the desert. The silent killers\r\nusually prey on smaller animals and even insects, digging their bodies into\r\na sandy dune until they are almost not visible anymore to the unaware eye.\r\nAs soon as a potential victim passes by, the cobra will perform a fast and\r\nsurprising strike, injecting its highly dangerous poison into the prey. Usually\r\nonly chasing for nurture, cobras can be easily provoked or irritated and might\r\nconsider any encounter a threat, fearlessly attacking everything regardless of\r\nits size. Although the tales of the fatality of its poison and its toughness\r\nare wildly exaggerated, they still pose a significant threat to all unexpecting\r\nwanderers and explorers.<BR>\n<BR>Cobras have 65 hitpoints. They are resistant against poison.\nIt takes 275 mana to summon or convince these creatures.\n<BR><BR>Cobras yield 90 experience points. They carry nothing with them.'),(21,'crab','Crabs','Sailors often call the Crabs the \'knights of the sea\', on the other hand,\r\nsailors drink plenty and no one should care much about what they have to say.\r\nIn fact Crabs live on the beach or in the sea. Their natural armour is very\r\nthick and their pinchers are suited to crush shells. Obviously, Crabs are well\r\nprepared to defend themselves and they surely will if they feel threatened.\r\nUsually they try to scare away intruders from their territory, but they do not\r\npursuit trespassers for long. The taste of their flesh is rather unusual but\r\nnot bad, some call it even a delicacy.<BR>\n<BR>Crabs have 55 hitpoints. They are resistant against poison.\nIt takes 305 mana to summon or convince these creatures.\n<BR><BR>Crabs yield 90 experience points. They carry fish and gold coins with them.'),(22,'crocodile','Crocodiles','Crocodiles lurk in the murky waters of swamps or lie seemingly lazy at the\r\nshores of rivers and seas. They are astonishing agile when they are catching\r\ntheir prey though, and many were misled by their otherwise slow motions. The\r\nstrength of their jaws is incredible and they hunt animals much larger than\r\nthemselves with ease. For hours they can wait motionlessly for the unwary to\r\napproach and then to strike at complete surprise. If they manage to catch some\r\nmammal in water, there is almost no escape. On land, their claws and their\r\nthick scale skin makes it an impressive fighter and a threat to everything\r\nalive. You are advised to stay away from shores or to go there only with\r\nutmost caution.<BR>\n<BR>Crocodiles have 105 hitpoints. \nIt takes 350 mana to summon or convince these creatures.\n<BR><BR>Crocodiles yield 120 experience points. They carry gold coins, ham, meat, and sometimes other items with them.'),(23,'cryptshambler','Crypt Shamblers','For a long time it was believed that the Crypt Shambler was a mere myth, and\r\neven though today most scholars agree that this undead abomination exists,\r\nlittle else is known about it. A common theory holds that Crypt Shamblers\r\nare created from the bodies of lesser necromancers and death cultists who\r\nwere turned into undead creatures while they were still alive! Although this\r\ntheory remains unconfirmed, it would help to explain the burning rage that\r\nseems to be a common trait of all Crypt Shamblers. Whatever the truth, Crypt\r\nShamblers are dangerous undead that far exceed many other undead in power\r\nand ferocity.<BR>\n<BR>Crypt Shamblers have 330 hitpoints. They are resistant against poison and cannot be paralyzed.\nIt takes 580 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Crypt Shamblers yield 585 experience points. They carry bones, gold coins, rotten meat, worms, and sometimes other items with them.'),(24,'cyclops','Cyclopses','Cyclopses are a human-like race but with only one eye and minor\r\nintelligence. They even talk in a similar language.\r\nThey live in holes where they prospect for gold and other metals.\r\nBe warned that they get very angry about adventurers entering their\r\nclaim and try to slay the intruder using their incredible power.<BR>\n<BR>Cyclopses have 260 hitpoints. \nIt takes 490 mana to summon or convince these creatures.\n<BR><BR>Cyclopses yield 450 experience points. They carry gold coins, ham, meat, and sometimes other items with them.'),(25,'darkmonk','Dark Monks','There are several monks that lost faith or were lured to the dark side,\r\nbut the Dark Monks form an own secret order whose goals lie in the shadow.\r\nNot much is known about their agenda or where they have come from. The\r\nofficial brotherhoods of monks deny any knowledge about this special order.\r\nIt is commonly assumed that Dark Monks serve some evil power since they\r\nreact hostile to most people and attack them on sight. Their fighting style\r\nclearly indicates a training in martial arts and they even use a small\r\narray of spells of which some, like draining of life-force, point to a\r\ndarker purpose of their order.<BR>\n<BR>Dark Monks have 190 hitpoints. \nIt takes 480 mana to convince these creatures but they cannot be summoned.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Dark Monks yield 435 experience points. They carry bags, breads, gold coins, lamps, scrolls, staffs, and sometimes other items with them.'),(26,'deer','Deer','Deer live in the forests and are nourished only by plants. They are\r\nabsolutely peaceable and very shy. They provide a wealthy source\r\nof food, but you must be very quick or work in teams in order to\r\nhunt them down. Bows are effective weapons for that task.<BR>\n<BR>Deer have 25 hitpoints. \nIt takes 260 mana to summon or convince these creatures.\n<BR><BR>Deer yield 0 experience points. They carry meat and ham with them.'),(27,'demon','Demons','The famous knight Apoc once wrote:<BR>\n<BR>\"Demons are the most malevolent, powerful, and dangerous creatures in Tibia.\r\nIn addition to their awesome physical strength, they can also use powerful\r\nspells, such as fireballs and firefields. Especially dangerous is their\r\ngaze, which can produce beams of pure energy to annihilate their poor\r\nvictims. Moreover, they drain mana off their victims, heal themself and\r\nsummon fire elementals as their vassals. Of course you can\'t trick them with\r\ninvisibility.<BR>\n<BR>Fortunately, demons usually live in the deepest dungeons near hell but\r\nsometimes they appear also on the surface. When they do, they leave a track\r\nof death and destruction behind them. Nobody has ever been able to slay even\r\none of these entities and only very few adventurers have survived an\r\nencounter with them.\"<BR>\n<BR>Demons have 8200 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Demons yield 18000 experience points. They carry gold coins, small emeralds, double axes, fire mushrooms, and sometimes other items with them.'),(28,'demonskeleton','Demon Skeletons','Demon Skeletons are undead monsters that live in the deepest dungeons\r\nof Tibia. Nobody knows where these creatures come from.\r\nThey are much stronger and faster than normal skeletons -\r\nfrom which they differ externally only by colour. Like them, they can\r\ndrain life energy off their opponents.<BR>\n<BR>Demon Skeletons have 400 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nIt takes 620 mana to summon or convince these creatures.\n<BR><BR>Demon Skeletons yield 720 experience points. They carry torches, gold coins, throwing stars, and sometimes other items with them.'),(29,'dog','Dogs','Dogs can be found as pets or roaming the streets of the cities.\r\nThey are absolutely peaceable and very affectionate. As they yield\r\nneither experience nor loot, killing them may be considered pure\r\ncruelty by animal-rights activists, and they might take revenge.<BR>\n<BR>Dogs have 20 hitpoints. \nIt takes 220 mana to summon or convince these creatures.\n<BR><BR>Dogs yield 0 experience points. They carry nothing with them.'),(30,'dragon','Dragons','Dragons were among the first creatures of Tibia and once ruled the whole\ncontinent. Nowadays, there are only a few of them left, which live deep in\nthe dungeons. Nevertheless, they are very powerful monsters and will strive\nfor killing every intruder. Besides their immense strength, they shoot\nfireballs at their victims and spit fire. Moreover, they can heal themselves\nand sense invisible adventurers.<BR>\n<BR>Dragons have 1000 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Dragons yield 2100 experience points. They carry gold coins, short swords, maces, crossbows, steel shields, dragon ham, and sometimes other items with them.'),(31,'dragonlord','Dragon Lords','Dragon Lords are the leaders of the dragons. They are even more powerful\r\nthan normal dragons that can usually be found in their company.\r\nLike normal dragons, they can throw fireballs, spit fire, and heal\r\nthemselves, but they can also throw great firebombs. And they can also\r\nsense invisible adventurers.<BR>\n<BR>Dragon Lords have 1900 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Dragon Lords yield 6300 experience points. They carry gold coins, dragon ham, green mushrooms, and sometimes other items with them.'),(32,'dwarf','Dwarfs','Dwarfs are a very ancient human-like race. Once they were famous all\r\nover Tibia for their craftsmanship, but since the War over the Creation\r\nthey only hide in their fortresses beneath the mountains and have\r\ndiscontinued all contact with humans. They are very suspicious towards\r\nany intruder and will vigorously try to repel him from their realms.<BR>\n<BR>Dwarfs have 90 hitpoints. They are resistant against poison.\nIt takes 320 mana to summon or convince these creatures.\n<BR><BR>Dwarfs yield 135 experience points. They carry axes, copper shields, gold coins, hatchets, leather legs, picks, white mushrooms, and sometimes other items with them.'),(33,'dwarfgeomancer','Dwarf Geomancers','It is a widespread misconception that dwarfs dislike all kinds of \r\nmagic. Dwarfs worship the powers of the elements, and the most gifted \r\namong them have managed to master the raw forces of earth and fire. Like \r\nall others of their race, Dwarf Geomancers are sturdy and strong. Instead \r\nof using the axe, they call on the power of earth to smash \r\ntheir enemies, hurling balls of molten rock at whoever is opposing them. \r\nEven worse, earth also confers amazing healing powers on Dwarf \r\nGeomancers, making them formidable enemies that are difficult to overcome.<BR>\n<BR>Dwarf Geomancers have 380 hitpoints. They are resistant against fire and poison.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Dwarf Geomancers yield 735 experience points. They carry bags, blank runes, gold coins, leather boots, magic light wands, pears, studded legs, white mushrooms, and sometimes other items with them.'),(34,'dwarfguard','Dwarf Guards','Dwarf Guards are a kind of militia among the dwarfs. They are very cunning\r\nand strong fighters and know the surroundings quite well. Their strategy is\r\nto lure small groups of intruders into traps that they have build using\r\ntheir astonishing craftsmanship.<BR>\n<BR>Dwarf Guards have 245 hitpoints. They are resistant against poison.\nIt takes 650 mana to summon or convince these creatures.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Dwarf Guards yield 495 experience points. They carry gold coins, leather boots, scale armors, white mushrooms, and sometimes other items with them.'),(35,'dwarfsoldier','Dwarf Soldiers','Dwarf Soldiers form the dwarfs\' army. They are quite strong\r\nfighters and know how to make use of the complex terrain very well. Due to\r\ntheir shortness they can use passages through the mountains where nobody can\r\nfollow them and attack with their crossbows from hiding-places where\r\nnobody expects them.<BR>\n<BR>Dwarf Soldiers have 135 hitpoints. They are resistant against poison.\nIt takes 360 mana to summon or convince these creatures.\n<BR><BR>Dwarf Soldiers yield 210 experience points. They carry bolts, gold coins, shovels, soldier helmets, white mushrooms, and sometimes other items with them.'),(36,'dworcfleshhunter','Dworc Fleshhunters','The most common members of the orcish subspecies known as dworcs (which\r\nare rumoured to be a hybrid of orcs and dwarfs) are known as Dworc Fleshhunters.\r\nThe name is referring to the cannibalistic habits of this disgusting race.\r\nDworc Fleshhunters serve as scouts, and in battles they form the shock troops\r\nof the dworcish tribes. With long lance-like weapons, they try to slow\r\ndown their enemies while other dworcs attack from a safe distance. Like\r\nall dworcs, the constant exposure to poison has made them immune to all\r\ntoxic effects, and like all dworcs they like to apply some sort of poison\r\non their weaponry. Without their allies their fighting abilities to delay\r\nand to distract their enemy becomes almost worthless, and so they pose only\r\na little threat to a seasoned fighter.<BR>\n<BR>Dworc Fleshhunters have 85 hitpoints. They are resistant against poison.\nIt takes 300 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Dworc Fleshhunters yield 105 experience points. They carry gold coins, leather armors, and sometimes other items with them.'),(37,'dworcvenomsniper','Dworc Venomsnipers','The Dworc Venomsnipers are usually the women of the tribes. It is disputable\r\nif this results in their weaker physical constitution or in the fact that\r\nthey are simply smarter than the average dworcish male. They are the dworcs\r\nwith the best knowledge and skills in brewing poison, and no Dworc Venomsniper\r\nhas ever been encountered without carrying various vials filled with some\r\ntoxin. Single snipers are a rare view. Usually, they hide behind the\r\nfleshhunters and hurl volleys of poisonous projectiles at their enemies\r\nfrom a safe distance. If they get cornered, they are easy prey since they\r\nlack the skill and weaponry to stand a serious assault on their own.<BR>\n<BR>Dworc Venomsnipers have 80 hitpoints. They are resistant against poison.\nIt takes 300 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Dworc Venomsnipers yield 90 experience points. They carry gold coins, leather armors, and sometimes other items with them.'),(38,'dworcvoodoomaster','Dworc Voodoomasters','The most evil stirps of the dworcish race resulted in the development of\r\nlikewise dark and sinister magic. The dworc vodoomasters are known and\r\nfeared for their curses and their ability to use sinister magic that drains\r\ntheir victim\'s life and mana. Being cowardly and sneaky, they prefer to\r\naccompany other dworcs on their attacks rather than to face enemies on their\r\nown. Fighting in the second line, they pose a serious threat by using spells\r\nthat allow their allies to defeat even much stronger enemies. Since the\r\nvoodoomasters are able to cover their retreat with curses and spells, it is\r\nhard to get hold of them. Lacking the ability to launch any threatening\r\nattack on their own, they fall quickly if they are actually caught alone.<BR>\n<BR>Dworc Voodoomasters have 80 hitpoints. They are resistant against poison.\nIt takes 300 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Dworc Voodoomasters yield 105 experience points. They carry gold coins, bones, leather armors, and sometimes other items with them.'),(39,'efreet','Efreets','The Efreet are the merciless leaders of the green djinns. Surpassing their\r\nlesser brethren both in power and in cruelty, the Efreet are truly terrible\r\nopponents who love to use their awesome powers to spread havoc among their\r\nenemies or sometimes among their own kind. The disdain they feel towards all\r\nother sentient races is second only to the undying hatred they feel towards\r\ntheir blue-skinned relatives, the Marid.<BR>\n<BR>Efreets have 550 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Efreets yield 900 experience points. They carry gold coins, heavy machetes, pears, small oil lamps, and sometimes other items with them.'),(40,'elderbeholder','Elder Beholders','Elder beholders are the masters of that necromantic race. They have grown\r\nenormously over times and outlived the usual lifespan of its kind by\r\ncheating death in some sinister way with its necromantic powers. Just like\r\nthe size of this creature has enlarged also its evilness and power has\r\ndone. Its magic outshines that of an ordinary beholder and its mastery of\r\nthe necromantic arts has reached levels that had so far been unknown to\r\nbeholders. It is them who spawn the dreaded gazers that grow into new\r\nbeholders and ensure the existence of the race. It is them who lead the\r\nother species of their kind with an iron will and brutal suppression. And\r\nit is them who have accumulated knowledge about magic and especially\r\nnecromancy that was never meant to be known by any creature, dead or alive.<BR>\n<BR>Elder Beholders have 500 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Elder Beholders yield 840 experience points. They carry gold coins, longswords, morning stars, and sometimes other items with them.'),(41,'elephant','Elephants','For a long time, tales about such creatures have been discarded as\r\nunbelievable stories of people who went mad or had feverish dreams. The\r\nelephant has two enormous, if not absurd long, teeth that could hint at a\r\nvampiric nature. The tentacle that it owns instead of a nose probably\r\nfunctions like a leech. However, the life-draining abilities of the elephant\r\nmust still be confirmed yet. Even without those rumoured powers, these\r\nbeasts are aggressive against any intruders and their sheer size and\r\nstrength is enough to crush any humanoid with ease. There are reports that\r\nthe creature is becoming even more dangerous if it is enraged. The large\r\nteeth are valuable to craftsmen and alchemists but they are hard to obtain\r\nsince those creatures\' strength makes it very difficult to kill them. Also\r\nthose teeth break easily in combat and become that way useless.<BR>\n<BR>Elephants have 320 hitpoints. \nIt takes 500 mana to summon or convince these creatures.\n<BR><BR>Elephants yield 480 experience points. They carry meat, ham, and sometimes other items with them.'),(42,'elf','Elves','Elves are a very ancient human-like race. They have a tall and beautiful\r\nfigure. In former days they travelled all over Tibia, now they have\r\nretreated to an area in the north of Tibia where they live in dwellings\r\nmade out of flourishing trees. Some of them are quite hospitable, but\r\nothers are very suspicious towards any intruder and will try to repel\r\nhim using their bows. Having a long history, the Elves are very skilled in\r\nmagic, and almost every Elf knows some spells.<BR>\n<BR>Elves have 100 hitpoints. \nIt takes 320 mana to summon or convince these creatures.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Elves yield 126 experience points. They carry brass shields, leather boots, red apples, studded armors, studded helmets, and sometimes other items with them.'),(43,'elfarcanist','Elf Arcanists','Elf Arcanists are the military guides of the elves. They belong to the\r\nmartial caste, the Kuridai, and all of them are very suspicious against\r\nany intruder. They are the strongest fighters among the elves, know\r\nto handle several distance fighting weapons, and are very skilled in\r\nmagic. They can even heal themselves and detect invisible adventurers.<BR>\n<BR>Elf Arcanists have 220 hitpoints. They are resistant against fire, poison, and energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Elf Arcanists yield 525 experience points. They carry scrolls, candlesticks, blank runes, staffs, sandals, melons, breads, and sometimes other items with them.'),(44,'elfscout','Elf Scouts','Elf Scouts are a kind of militia among the elves. They patrol the area\r\naround their dwellings and repel intruders. Due to their tall bodies, \r\nall elves are fast runners and can cover large distances. In close combat\r\nthey are quite weak, but their distance fighting weapons are dreaded.\r\nLike all elves they can sense invisible creatures.<BR>\n<BR>Elf Scouts have 160 hitpoints. \nIt takes 360 mana to summon or convince these creatures.\n<BR><BR>Elf Scouts yield 225 experience points. They carry arrows, gold coins, grapes, poison arrows, sandals, studded armors, waterskins, and sometimes other items with them.'),(45,'firedevil','Fire Devils','Fire Devils are very ugly creatures that have been spotted in the deserts\r\nof Tibia. Nobody knows where these beings came from.\r\nJust like the devils from the myths, they carry a pitchfork with them\r\nand one of their feet is that of a goat. But are they real devils?\r\nHowever, their pungent gaze makes the experienced traveller shaken\r\nand their fireballs are quite dangerous.<BR>\n<BR>Fire Devils have 200 hitpoints. They are resistant against fire.\nIt takes 530 mana to summon or convince these creatures.\n<BR><BR>Fire Devils yield 330 experience points. They carry torches, blank runes, pitchforks, and sometimes other items with them.'),(46,'fireelemental','Fire Elementals','Fire Elementals are entities consisting only of fire. They have been spotted\r\nin the wake of demons, and nobody knows whether they are summoned by them or\r\nwhether they are independent creatures rising out of fire. They are very\r\ndangerous fighters and create firefields or shoot fireballs at their\r\nopponents. Their magical nature enables them to sense invisible opponents.<BR>\n<BR>Fire Elementals have 280 hitpoints. They are resistant against fire and cannot be paralyzed.\nIt takes 690 mana to summon or convince these creatures.\n<BR><BR>Fire Elementals yield 660 experience points. They carry nothing with them.'),(47,'flamingo','Flamingoes','The Flamingo is a beautiful but rather useless bird. Its meat is not edible\r\nand only its feathers might have some value. Chasing this shy but fast bird\r\nis not recommended since you can quickly run in one of the predators of the\r\njungle, and to expose yourself to this danger is not worth it. Some wealthy\r\npersons like to adorn their gardens with those lovely birds, and since it is\r\nquite difficult to catch a Flamingo alive, these animals achieve good prices\r\non the market.<BR>\n<BR>Flamingoes have 25 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Flamingoes yield 0 experience points. They carry nothing with them.'),(48,'frosttroll','Frost Trolls','Frost Trolls are a variety of normal trolls that live in the holes and\r\ndungeons of the ice islands in the north-west of Tibia. Like their\r\ncousins, they hunt animals and seek treasures. But they are a bit\r\nstronger than them and can be quite dangerous to inexperienced\r\nadventurers.<BR>\n<BR>Frost Trolls have 55 hitpoints. \nIt takes 300 mana to summon or convince these creatures.\n<BR><BR>Frost Trolls yield 69 experience points. They carry gold coins, rapiers, spears, wooden shields, coats, fish, and sometimes other items with them.'),(49,'gargoyle','Gargoyles','Although gargoyles are a common sight all over Tibia, the origin of this\r\nremarkable species remains clouded in mystery. In fact, a reward offered\r\nby the great wizard Cyrius the Half-Bald to those who could solve the\r\nmystery was never claimed. However, one or two interesting facts have been\r\ndiscovered. It is widely agreed today that gargoyles prefer dark places,\r\nwhich is why they are typically found in dreary dungeons and other\r\nsubterranean complexes. There they breed and hunt, using their uncanny\r\nability to blend in with the stony surfaces of their lairs.<BR>\n<BR>Gargoyles have 250 hitpoints. They are resistant against fire and poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Gargoyles yield 450 experience points. They carry small stones, gold coins, meat, ham, and sometimes other items with them.'),(50,'gazer','Gazers','Gazers are the spawn of the beholders. Sometimes a beholder splits up a\r\npart of itself that functions like a slimy egg which evolves into a gazer\r\nat incredible speed. Right from its \'birth\', the gazer owns some basic\r\nintelligence which it has been inherited by its parent beholder. Still\r\nit has only vague memories, and also no concrete knowledge but rather\r\nsome instinct of an underdeveloped magic. It is said that elder beholders\r\ncan spawn gazers even without producing an egg, but this offspring is\r\nusually flawed and dies rather quickly.<BR>\n<BR>Gazers have 120 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Gazers yield 270 experience points. They carry gold coins and sometimes other items with them.'),(51,'ghost','Ghosts','Ghosts have been spotted in the haunted ruins of Drefia on Darama.\r\nSome people say that they are the souls of the former inhabitants,\r\nwhich died in that horrible disaster destroying the once beautiful city.\r\nIndeed they are supernatural in some way, as no physical weapon\r\ncan hit them, and their shivering touch makes their\r\nopponents loose some vitality.<BR>\n<BR>Ghosts have 150 hitpoints. They are resistant against poison and cannot be hit by physical weapons nor be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Ghosts yield 360 experience points. They carry morning stars, sandals, shadow herbs, and sometimes other items with them.'),(52,'ghoul','Ghouls','Ghouls are undead monsters that live in the holes and dungeons of Tibia.\r\nThey are quite strong and extremely dangerous if they crop up in packs.\r\nHiding in the darkness, they wait for uncautious adventurers.\r\nThey can heal themselves and suck life energy out of their opponents.<BR>\n<BR>Ghouls have 100 hitpoints. They are resistant against poison and cannot be paralyzed.\nIt takes 450 mana to summon or convince these creatures.\n<BR><BR>Ghouls yield 255 experience points. They carry torches, gold coins, knives, brass helmets, worms, and sometimes other items with them.'),(53,'giantspider','Giant Spiders','Giant Spiders live in holes in the mountains of Tibia. They are among the\r\nmost powerful monsters and are so fast that it is nearly impossible to flee.\r\nThey can summon poison spiders and throw poison fields. Moreover, they can\r\nsense invisible adventurers.<BR>\n<BR>Giant Spiders have 1300 hitpoints. They are resistant against fire and poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Giant Spiders yield 2700 experience points. They carry gold coins, plate armors, and sometimes other items with them.'),(54,'goblin','Goblins','Goblins are a human-like race that lives in small tribes in the\r\nhills in the centre of Tibia. They are ugly and stinking creatures\r\nthat mainly live on tubers and roots. They are weak but cunning\r\nfighters and use their slings to ambush and rob travellers.<BR>\n<BR>Goblins have 50 hitpoints. \nIt takes 290 mana to summon or convince these creatures.\n<BR><BR>Goblins yield 75 experience points. They carry small stones, gold coins, bones, daggers, leather helmets, small axes, fish, and sometimes other items with them.'),(55,'greendjinn','Green Djinns','In ancient times the green djinns lost a great war against their blue\r\nbrethren. Considered to be extinct, the last knowledge of these powerful\r\nbeings turned into legends and legends became fairytales. Those who\r\nencountered one of the recently resurfaced self-proclaimed masters of evil\r\ncan attest that they are reality indeed, and not a pleasant one. The\r\nmagic-wielding enemies of all good embrace destruction enjoy causing pain.\r\nAlthough only inferior members of the green-skinned race have been sighted\r\nby now, they are enemies to beware of. Their magical tricks make them more\r\nthan a match for unexpecting adventurers. Despising all living beings and\r\neverything which is beautiful, their especially passionate hatred is\r\nreserved for their blue-skinned relatives though, whom they regard as\r\ntraitors to djinnkind.<BR>\n<BR>Green Djinns have 330 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Green Djinns yield 570 experience points. They carry gold coins, grave flowers, cheese, and sometimes other items with them.'),(56,'hero','Heroes','The heroes that prowl the isle of Edron were among the first explorers.\r\nOnce brave knights and loyal to the king, too close contact with evil monsters\r\nor greed for treasures - nobody knows for sure - turned their hearts.\r\nNow, they attack every intruder of their sphere using their incredible strength\r\nor their dangerous bows. Of course, they can sense invisible opponents.<BR>\n<BR>Heroes have 1400 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Heroes yield 3600 experience points. They carry scrolls, lyres, ropes, gold coins, bows, arrows, scarfs, meat, grapes, red roses, and sometimes other items with them.'),(57,'hunter','Hunters','Hunters are outlaws that dwell in the large forests of Tibia.\r\nThey do not only hunt animals but also attack travellers and adventurers.\r\nAlthough they are not strong, they are very deadly due to their quickness\r\nand their bows.<BR>\n<BR>Hunters have 150 hitpoints. \nIt takes 530 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Hunters yield 450 experience points. They carry bows, leather helmets, arrows, leather legs, oranges, rolls, and sometimes other items with them.'),(58,'hyaena','Hyaenas','Long regarded only as a scavenger, the hyena is quite capable of bringing\r\ndown prey as large as a deer. This strong, stocky beast is found in the\r\ndaramanian deserts. Its jaws are powerful, in proportion to its size, and\r\nquite dangerous. Being truly the craven cowards they have often been depicted\r\nas, they are fast to abandon a fight and flee. They usualy hunt in packs,\r\nmostly at night. They chase their prey until it is exhausted, then the pack\r\nsets upon its victim and disembowels it. These noisy animals have several\r\ntypes of cries and bloodcurdling howls. They make a maniacal laughing sound\r\nwhen attacking which turns rapidly into a misable whimper if they suffered\r\nfrom too many counterattacks and see their lives endangered.<BR>\n<BR>Hyaenas have 60 hitpoints. \nIt takes 275 mana to summon or convince these creatures.\n<BR><BR>Hyaenas yield 60 experience points. They carry meat and worms with them.'),(59,'hydra','Hydras','The many-headed hydra is a distant cousin of the dragon. Although probably\r\nnot more intelligent than a beast, the hydra has magical abilities. The\r\nbreath of the hydra is poisonous and it traditionally uses a forceful splash\r\nof hot water as a weapon. As dangerous as this might be, the true danger\r\nlies in the hydra\'s incredible healing powers. Even severed heads grow back\r\nwithin a few heartbeats and each injury seems only to increase the creature\'s\r\nravenous hunger. The hydra seems to flourish in warm climate and usually\r\nbuild its lair close to greater bodies of water. Although the jungles\r\nclimate seems to benefit their breeding, it is not uncommon to encounter\r\nsmall hydra colonies in milder climate as well. Other than their dragon\r\ncousins, hydras shun the dry heat. Hydras are not known to hoard treasures\r\non purpose but having been on this earth for quite some time, and only\r\nrandomly losing a fight, the belongings of their victims have started to\r\nfill up their caves. Since the eyes of a hydra see basically everything, \r\nit is not possible to fool it with a simple invisibility spell.<BR>\n<BR>Hydras have 2250 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Hydras yield 6300 experience points. They carry gold coins, ham, meat, and sometimes other items with them.'),(60,'kongra','Kongras','The mighty kongras are like mountains made of flesh and muscles. These\r\nenormous apes are incredibly strong and quite agile for their mass and\r\nsize. They seem to be the warriors of the apes that live in the deepest\r\njungle and raid the human settlements from time to time. In its anger a\r\nkongra is able to rip out small trees and to break bones as if they were\r\ntwigs. The sight of an enraged, storming kongra can make even an\r\nexperienced warrior tremble. The dark and massive figure reaches a\r\nthreatening speed in its attacks. Relying mainly on its strength, a\r\nkongra rarely uses any weapons. Occasionally, the ape warrior uses stones\r\nof different sizes or breaches as makeshift weapons, but usually it relies\r\non its hammer-like fists and the clout of its powerful arms.<BR>\n<BR>Kongras have 340 hitpoints. \nThese creatures can neither be summoned nor convinced.\n<BR><BR>Kongras yield 315 experience points. They carry gold coins, bananas, and sometimes other items with them.'),(61,'larva','Larvas','The larva of the daramanian desert scarab is a small, yet poisonous insect\r\nthat usually avoids the sun and dwells only underground. Lacking the hard\r\nshells which protect older scarabs and moving rather slowly, they do not pose\r\na too dangerous threat to a well armed warrior. However, in greater numbers\r\nthey can bring down even a capable foe. Since they usually prefer to remain\r\nwith their siblings, it is unfortunately not rare to encounter a pack of them\r\nat once.<BR>\n<BR>Larvas have 70 hitpoints. They are resistant against poison and cannot be paralyzed.\nIt takes 355 mana to summon or convince these creatures.\n<BR><BR>Larvas yield 132 experience points. They carry meat and gold coins with them.'),(62,'lich','Liches','To become a lich is the ultimate goal of all those who follow the dark path\r\nof necromancy, and there is no one among these lost souls who would not give\r\nhis life gladly in exchange for the immortality and the frightful powers of\r\nthese undead wizards. The lich are true masters of their kind who have learnt\r\nto harness the vilest powers of death and corruption, and they know how to\r\nchannel these unholy energies onto their unfortunate victims with deadly\r\nprecision. Worse, they typically control legions of lesser undead, so a single\r\nlich may be enough to bring whole cities to ruin. Thankfully, they are very\r\nrare and they often prefer to hide in old libraries and laboratories where\r\nthey ceaselessly continue their wicked research.<BR>\n<BR>Liches have 880 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Liches yield 2700 experience points. They carry staffs, gold coins, spellbooks, dirty capes, and sometimes other items with them.'),(63,'lion','Lions','Lions are beasts of prey that live in the deserts and savannahs of Tibia.\r\nThey are very quick and try to hunt their victim down to kill it with\r\na single bite. It is recommended to attack them with distance fighting\r\nweapons.<BR>\n<BR>Lions have 80 hitpoints. \nIt takes 320 mana to summon or convince these creatures.\n<BR><BR>Lions yield 90 experience points. They carry ham and meat with them.'),(64,'lizardsentinel','Lizard Sentinels','Even the lizard people of the lowest caste follow some kind of spiritual\r\npath. Lizard Sentinels form a kind of temple guard rather than an army.\r\nFollowing the orders of templars and snakecharmers, they work, fight and\r\ndie for the welfare of the lizard race. Bred and raised for this purpose,\r\nonly the Lizard Sentinels seem to have an almost steady supply for their troops\r\nwhose strength lies in their numbers. They are rather distance than melee\r\nfighters and they try to shun close combat which seems to be a privilege\r\nof the templars. If Lizard Sentinels are forced to fight eye to eye, they\r\ndefend themselves almost reluctantly as if they were even in the face of\r\ndeath trying to avoid breaking any taboo.<BR>\n<BR>Lizard Sentinels have 265 hitpoints. They are resistant against poison.\nIt takes 560 mana to convince these creatures but they cannot be summoned.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Lizard Sentinels yield 315 experience points. They carry gold coins, spears, and sometimes other items with them.'),(65,'lizardsnakecharmer','Lizard Snakecharmers','Half priest and half wizard, Lizard Snakecharmers seem to be the spiritual\r\nleaders of the lizard people. They are skilled in casting several spells and\r\nshow a strong affinity to snakes and poison. Like snakes, which they are\r\nassumed to worship, they like to wait until their victim shows a weakness that\r\nallows them to strike. Keeping their enemies at distance, their sudden attacks\r\noften take the victims by surprise which gives the Lizard Snakecharmers an\r\nedge in combat. Recently, they have settled their quarrels with the warriors of\r\ntheir race to form a formidable team to fight against their common enemy and\r\nto fend off any intruders in their territory.<BR>\r\n<BR>Lizard Snakecharmers have 325 hitpoints. They are resistant against poison.\r\nThese creatures can neither be summoned nor convinced.\r\nIn addition, they are able to sense invisible creatures.\r\n<BR><BR>Lizard Snakecharmers yield 630 experience points. They carry dead snakes, dirty capes, gold coins, and sometimes other items with them.'),(66,'lizardtemplar','Lizard Templars','The proud holy warriors of the lizard race follow a strange code of honour\r\nwhich cannot be understood by the other races. Part of this code seems to be\r\nfighting valiantly the warm-blooded races which they regard as intruders in\r\ntheir realm. Their thick scale skin, their incredible toughness and their\r\nunwavering determination to win a fight had made the lizard people the\r\ndominating race in Tiquanda for a long time. Even their enemies must credit\r\nthem skillfulness and elegance in the usage of their exotic weapons. Probably,\r\nlizards see a fight as a religious experience. Their fighting style is\r\nobviously very formalised yet very efficient. The snake-like blade-dance\r\nthat they perform in combat is only clouded by their overconfidence and\r\ntheir inability to accept defeat.<BR>\n<BR>Lizard Templars have 410 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Lizard Templars yield 435 experience points. They carry gold coins, short swords, and sometimes other items with them.'),(67,'marid','Marids','The proud Marid are the strongest warriors among the noble race of the\r\nblue djinn. They possess amazing magical powers, and their prowess in battle\r\nis truly fearsome. However, their undeniable power as well as their race\'s\r\nnatural tendency towards pride make them vulnerable to the temptations of\r\nvanity and arrogance. The Marid, being devout followers of the prophet\r\nDaraman\'s teachings, try to resist these temptations as well as they can,\r\nbut it has happened before that a Marid strayed from the true path and\r\nsuccumbed to the corruption and the lowly desires that are hidden deep in the\r\nsoul of every djinn. Beware of such fallen Marid, because they are no better\r\nthan the Efreet, the Marids\' green-skinned djinn cousins and arch-enemies.<BR>\n<BR>Marids have 550 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Marids yield 900 experience points. They carry blueberries, gold coins, heavy machetes, small oil lamps, and sometimes other items with them.'),(68,'merlkin','Merlkins','Even a few of the ape people are able to command some kind of strange magic.\r\nIt is hard to say which role the merlkins play in the ape society, but they\r\nare probably described best as some kind of primitive witch doctors. It is\r\nanother mystery how those primitives were able to develop any kind of magic\r\nat all, but considering the fact that those apes raid the human settlements\r\nto steal their tools, it is very likely that they have also stolen their\r\nknowledge about magic. Their ability to wield magic hints at a greater\r\nintelligence than that of their cousins with whom they seem to live in an\r\nuneasy peace. Animosities between the different breeds have been reported,\r\nso it is unlikely that the merlkin are a kind of elite among the apes. Still\r\nthey work together with the other ape races and their strange magic\r\ncombined with the skills of the others form very effective attack forces.<BR>\n<BR>Merlkins have 230 hitpoints. They are resistant against energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Merlkins yield 330 experience points. They carry gold coins, bananas, and sometimes other items with them.'),(69,'minotaur','Minotaurs','Minotaurs are cross-breeds of humans and bulls. They live in great caves\r\nwhere they even build proper towns. Furthermore, they arrange troops\r\nthat repel every intruder from their empire. Minotaurs are average\r\nfighters, but organized as a military squad they can be quite dangerous.<BR>\n<BR>Minotaurs have 100 hitpoints. \nIt takes 330 mana to summon or convince these creatures.\n<BR><BR>Minotaurs yield 150 experience points. They carry gold coins, swords, maces, chain armors, plate shields, leather legs, meat, and sometimes other items with them.'),(70,'minotaurarcher','Minotaur Archers','Minotaur Archers form the artillery of the minotaurs\' army. Using their\r\ncrossbows they shoot bolts at their enemies. Many adventurers have\r\ndied in the hail of missiles. Usually, they are accompanied by other\r\ntypes of minotaurs.<BR>\n<BR>Minotaur Archers have 100 hitpoints. \nIt takes 390 mana to summon or convince these creatures.\n<BR><BR>Minotaur Archers yield 195 experience points. They carry gold coins, crossbows, bolts, meat, and sometimes other items with them.'),(71,'minotaurguard','Minotaur Guards','Minotaur Guards form the heavy troops of the minotaurs\' army. They are\r\ntough shortrange fighters but vulnerable by distance fighting weapons.\r\nWatch out for archers that are casually placed in the second row\r\nbehind them.<BR>\n<BR>Minotaur Guards have 185 hitpoints. \nIt takes 550 mana to summon or convince these creatures.\n<BR><BR>Minotaur Guards yield 480 experience points. They carry gold coins, hatchets, leather legs, meat, and sometimes other items with them.'),(72,'minotaurmage','Minotaur Mages','Minotaur Mages are the elite of the minotaurs\' army. With their magic\r\nthey support the other troops in a fight. They can create energy fields and\r\nshoot fireballs or magic missiles. Moreover, they can sense\r\ninvisible adventurers. As they are weak shortrange fighters, guards will\r\nprotect them while they operate from the second row.<BR>\n<BR>Minotaur Mages have 155 hitpoints. They are resistant against energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Minotaur Mages yield 450 experience points. They carry torches, gold coins, knives, leather helmets, leather legs, carrots, dead snakes, and sometimes other items with them.'),(73,'monk','Monks','In ancient times, long before Edron has been re-discovered, some monks,\r\nfollowers of the evil god Zathroth, have founded a monastery in the dungeons\r\ndeep below the surface. They are not well disposed towards the explorers\r\nthat are now coming there, and will attack every intruder fiercely. They\r\nare skilled fist fighters and can heal themselves. Moreover they can see\r\ninvisible opponents.<BR>\n<BR>Monks have 240 hitpoints. \nIt takes 600 mana to summon these creatures but they cannot be convinced.\n<BR><BR>Monks yield 600 experience points. They carry scrolls, bags, lamps, gold coins, staffs, breads, and sometimes other items with them.'),(74,'mummy','Mummies','Mummies are undead monsters that can be found in the ancient pyramids\r\nand ruins in the north of Tibia. No one knows where they come from, but\r\nthey guard the burial chambers and attack every adventurer trying to\r\nget the legendary treasures. Their scaring sight can paralyze the bravest\r\nfighters, and they try to drain life energy off their shocked victims.\r\nBe aware of their poisonous daggers, and note that they\r\ncan even sense invisible opponents.<BR>\n<BR>Mummies have 240 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Mummies yield 450 experience points. They carry gold coins, magic light wands, worms, and sometimes other items with them.'),(75,'necromancer','Necromancers','Necromancers are powerful magicians which pursue studies on undead creatures\r\nin the haunted ruins of Drefia on Darama.\r\nNobody knows what they intend to use their perilous knowledge for and which\r\ndreadful secrets they already have discovered, but adventurers, who have\r\nmanaged to escape from their realm, report that they are able to summon\r\nseveral kinds of undead creatures like skeletons, ghouls, and mummies. \r\nThey can heal themselves and they know how to drain life energy\r\noff their opponents. Although they are quite strong fighters, they prefer\r\ndistance fighting, namely shooting magic missiles and letting their summoned\r\nservants fight for them. Invisible opponents are without a chance to escape\r\ntheir attacks.<BR>\n<BR>Necromancers have 580 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Necromancers yield 1740 experience points. They carry gold coins, short swords, scale armors, and sometimes other items with them.'),(76,'orc','Orcs','Orcs are a very ancient race that once ruled the whole of Tibia.\r\nLater, they were expelled from the upper world by other races, and now\r\nthey live in the dungeons of Tibia. They are human-like and very wily.\r\nOrganized as paramilitary squads they can be quite dangerous.<BR>\n<BR>Orcs have 70 hitpoints. \nIt takes 300 mana to summon or convince these creatures.\n<BR><BR>Orcs yield 75 experience points. They carry studded armors, studded shields, meat, gold coins, and sometimes other items with them.'),(77,'orcberserker','Orc Berserkers','Orc Berserkers are the strongest fighters among the orcs. Their favourite\r\ntactic is the assault, where they can use their velocity and their\r\nhalberds to kill their victim with a single stroke. Having survived their\r\nattack, watch out for other types of orcs that are usually in their\r\ncompany.<BR>\n<BR>Orc Berserkers have 210 hitpoints. They are resistant against poison.\nIt takes 590 mana to summon or convince these creatures.\n<BR><BR>Orc Berserkers yield 585 experience points. They carry gold coins, chain armors, chain helmets, ham, and sometimes other items with them.'),(78,'orcleader','Orc Leaders','Orc Leaders are the commanders of the orcs\' army. They are quite clever\r\nand know how to arrange the different troops - warriors, berserkers,\r\nspearmen, and shamans - to form powerful squads. They themselves are\r\nquite strong fighters that uses even throwing knives. Their skills enable\r\nthem to sense invisible opponents.<BR>\n<BR>Orc Leaders have 450 hitpoints. They are resistant against fire.\nIt takes 640 mana to summon or convince these creatures.\n<BR><BR>Orc Leaders yield 810 experience points. They carry backpacks, gold coins, daggers, throwing knives, scimitars, plate shields, meat, fish, and sometimes other items with them.'),(79,'orcrider','Orc Riders','Orc Riders are Orcish elite troops mounted on grim Warwolves. Their \r\nfearsome steeds make them fast and agile, while their heavy lances can \r\ndeal impressive damage. Orc Rider patrols can mostly be found in the \r\nplains of Tibia where the terrain is ideal for mounted combat. It is \r\nvery difficult to run way from a pack of Orc Riders once you have had \r\nthe misfortune to meet them.<BR>\n<BR>Orc Riders have 180 hitpoints. \nIt takes 490 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Orc Riders yield 330 experience points. They carry backpacks, gold coins, wolf tooth chains, orcish axes, studded helmets, meat, and sometimes other items with them.'),(80,'orcshaman','Orc Shamans','Orc Shamans are the magicians among the orcs. They support the other\r\ntroops during a fight. They can shoot fireballs and magic missiles.\r\nThey even summon snakes to set them on their enemies. Moreover, they\r\ncan heal themselves and sense invisible adventurers.<BR>\n<BR>Orc Shamans have 115 hitpoints. They are resistant against poison and energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Orc Shamans yield 330 experience points. They carry bags, spears, corncobs, gold coins, and sometimes other items with them.'),(81,'orcspearman','Orc Spearmen','Orc Spearmen are the distance fighters among the orcs. Their spears\r\nare deadly weapons, but they are weak shortrange fighters. \r\nUsually, they are accompanied by other types of orcs, so that they can\r\nhide behind them and attack their enemies from the second row.<BR>\n<BR>Orc Spearmen have 105 hitpoints. \nIt takes 310 mana to summon or convince these creatures.\n<BR><BR>Orc Spearmen yield 114 experience points. They carry gold coins, machetes, meat, spears, studded legs, and sometimes other items with them.'),(82,'orcwarlord','Orc Warlords','Fiercer than the dreaded Orc Berserker and more powerful even than the \r\nmighty Orc Leader, the Orc Warlord is the true terror of all civilized \r\nraces.\r\nWarlords are the strongest fighters of their race who have managed to \r\nrise to the highest ranks through treachery and murder. Even though they \r\nare extremely skilled fighters who can cut a man in two with a single \r\nstroke of their mighty blades, Orc Warlords prefer to use their superior \r\nspeed and cunning to overcome their enemies. They avoid open combat \r\nwhenever they can, sneaking up on unwary adventurers from behind or \r\nthrowing their vicious Shuriken instead.<BR>\n<BR>Orc Warlords have 950 hitpoints. They are resistant against fire.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Orc Warlords yield 2010 experience points. They carry gold coins, scimitars, throwing stars, orcish axes, brass legs, meat, fish, and sometimes other items with them.'),(83,'orcwarrior','Orc Warriors','Orc Warriors are the simple fighters among the orcs. They are weaker\r\nthan berserkers, but using their sabres or daggers they can be quite\r\ndangerous in the small corridors of the dungeons. Watch out for\r\nother types of orcs - like spearmen or shamans - which might hide\r\nin the second row.<BR>\n<BR>Orc Warriors have 125 hitpoints. \nIt takes 360 mana to summon or convince these creatures.\n<BR><BR>Orc Warriors yield 150 experience points. They carry gold coins, sabres, wooden shields, meat, and sometimes other items with them.'),(84,'panda','Pandas','The cute looks of the panda is misleading. Above all, the panda is a\r\nbear and as such short-tempered and fast in its attacks. It is just as\r\nstrong as other bears, and the only major difference to its\r\nconspecifics is its habitat. Panda bears that were caught and shipped\r\nto Thais died quickly and even though magic was used, no panda survived\r\nmore than a week away from its home. It is found most often in the\r\nsouthern regions of Tiquanda. Considering that they share their\r\nterritory with the vile dworcs and other savage creatures, it is quite\r\nobvious that they are fierce fighters.<BR>\n<BR>Pandas have 80 hitpoints. They are resistant against poison.\nIt takes 300 mana to summon or convince these creatures.\n<BR><BR>Pandas yield 69 experience points. They carry meat and ham with them.'),(85,'parrot','Parrots','The most intelligent bird in the known world is the colourful Parrot.\r\nIt is even possible to teach it a few words. It is disputed if the bird\r\nis actually aware of what it is saying, after all a Parrot is at most\r\nas smart as an orc or a troll. The bird is usually unaggressive and\r\nin the wilderness it flees as soon as someone approaches it. Caught\r\nParrots can be tamed and trained though. It takes some patience to\r\nteach them some simple sentences but the patience is ultimately\r\nrewarded with a funny companion whose buffoonery amuses its owner.<BR>\n<BR>Parrots have 25 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Parrots yield 0 experience points. They carry nothing with them.'),(86,'pig','Pigs','Pigs are domestic animals which are kept by farmers. They stem from\nwild boars and have been raised by humans for a long time to gain meat.\nThey are absolutely peaceable and eat or sleep the whole day. However,\nthe farmers will be upset if you kill one of them.<BR>\n<BR>Pigs have 25 hitpoints. \nIt takes 255 mana to summon or convince these creatures.\n<BR><BR>Pigs yield 0 experience points. They carry meat with them.'),(87,'poisonspider','Poison Spiders','Poison Spiders live in the forests and dungeons of Tibia. They usually hunt\r\nsmall animals, but with their poisonous bite they can even kill animals that\r\nare bigger than them. Therefore, and as they always crop up in packs, they\r\nare quite dangerous for badly equipped adventurers.<BR>\n<BR>Poison Spiders have 26 hitpoints. They are resistant against poison.\nIt takes 270 mana to summon or convince these creatures.\n<BR><BR>Poison Spiders yield 66 experience points. They carry gold coins with them.'),(88,'polarbear','Polar Bears','Polar Bears live at the ice islands in the north-west of Tibia.\r\nThey are nourished by fish and small animals. They are stronger and\r\nmore aggressive than their brown cousins. Avoid their powerful stroke\r\nand attack them with distance fighting weapons.<BR>\n<BR>Polar Bears have 85 hitpoints. \nIt takes 315 mana to summon or convince these creatures.\n<BR><BR>Polar Bears yield 84 experience points. They carry ham and meat with them.'),(89,'priestess','Priestesses','Priestesses came to Edron together with the monks. They also are followers\r\nof the evil god Zathroth, but they roam the dungeons instead of having a\r\nhome. Like the monks, they will fiercely attack every intruder into their\r\nholy realm. They are weak fighters, but have a lot of magic abilities. They\r\nshoot magic missiles at their enemies and drain mana off them, summon ghouls\r\nas reinforcements, and heal themselves.<BR>\n<BR>Priestesses have 390 hitpoints. They are resistant against fire, poison, and energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Priestesses yield 1260 experience points. They carry bowls, daggers, goat grasses, sling herbs, and sometimes other items with them.'),(90,'rabbit','Rabbits','Rabbits live in the meadows and forests of Tibia, where they are nourished\r\nonly by blades of grass. People often hunt these absolutely peaceable and\r\nvery shy animals for their skins, from which tanners can make fine clothes.\r\nBut you must be very quick in order to catch them.<BR>\n<BR>Rabbits have 15 hitpoints. \nIt takes 220 mana to summon or convince these creatures.\n<BR><BR>Rabbits yield 0 experience points. They carry carrots and meat with them.'),(91,'rat','Rats','Rats live in the sewers of each town, in holes, and in dungeons. Cropping\r\nup in masses they are a real plague, and the governments pay head money for\r\ndead rats. They are quite weak, but in packs they can be dangerous for\r\nbadly equipped adventurers.<BR>\n<BR>Rats have 20 hitpoints. \nIt takes 200 mana to summon or convince these creatures.\n<BR><BR>Rats yield 15 experience points. They carry cheese, gold coins, and worms with them.'),(92,'rotworm','Rotworms','Rotworms are a very ancient race that lives in the dungeons of Tibia.\r\nThey dig in the earth and wait for unconscious victims which they devour\r\nin one piece. Hidden in the earth they are unsusceptible for\r\ndistance fighting weapons. In packs, they are quite dangerous even for\r\nexperienced adventurers.<BR>\n<BR>Rotworms have 65 hitpoints. \nIt takes 305 mana to convince these creatures but they cannot be summoned.\n<BR><BR>Rotworms yield 120 experience points. They carry meat, ham, gold coins, worms, and sometimes other items with them.'),(93,'scarab','Scarabs','The scarab is in general associated with buried secrets and wisdom,\r\nwhich made this beetle an important religious symbol for the city of\r\nAnkrahmun. Typically found in their underground lairs, they also inhabit\r\nsacred places such as temples or tombs. Scarabs protect their charge with\r\nferocious intent. They will attack anyone who dares to intrude their area\r\nand will not relent until the threat is eliminated. Their shells are\r\nimmensely hard and sometimes weapons might get caught in their chitinous\r\narmor. They are able to concentrate their poison in a deadly cloud of\r\nnauseating fumes that especially cover their retreat if overwhelmed.<BR>\n<BR>Scarabs have 320 hitpoints. They are resistant against poison and cannot be paralyzed.\nIt takes 395 mana to summon or convince these creatures.\n<BR><BR>Scarabs yield 360 experience points. They carry meat, gold coins, and sometimes other items with them.'),(94,'scorpion','Scorpions','Scorpions live in the swamps and deserts of Tibia. They usually hunt small\r\nanimals but when they get excited they even attack humans. Their very\r\npoisonous sting penetrates even thick armor so that they can be a great\r\nthreat when they attack surprisingly. As their defence is quite weak you\r\nshould strive to do the first strike.<BR>\n<BR>Scorpions have 45 hitpoints. They are resistant against poison.\nIt takes 310 mana to summon or convince these creatures.\n<BR><BR>Scorpions yield 135 experience points. They carry nothing with them.'),(95,'serpentspawn','Serpent Spawns','The hideous Serpent Spawn is rumoured to be the creation of some ancient \r\nserpent god once worshipped by the lizardmen of Tiquanda. In ancient \r\ntimes, this creature, chosen by the gods, was a vital part of the lizard \r\nculture and the centre of numerous gruesome rituals. With the downfall \r\nof the lizard civilisation, the Serpent Spawn became more and more \r\nuncontrollable, and finally started to become a threat to the lizards \r\nthemselves. As if their minds had been darkened by a madness that \r\nmirrored the turmoil in the lizard society, they made no difference \r\nbetween friend or foe and their lethal wrath struck both. By making the \r\nmost holy places of the lizards inaccessible, they sealed the fate of \r\nthe lizard civilisation during the apes\' revolt.\r\nIt is rumoured there are still species of the Serpent Spawn around. \r\nStill guarding the sacred places with eternal vigilance, they are \r\nwaiting for their creator to rise again and to lead them once more to \r\nreign the jungle of Tiquanda on the god\'s behalf. Being servants of the \r\nserpent god, they are blessed with magic abilities and their serpent \r\nheritage grants them enormous physical strength and constitution.<BR>\n<BR>Serpent Spawns have 3000 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Serpent Spawns yield 6000 experience points. They carry gold coins, green mushrooms, and sometimes other items with them.'),(96,'sheep','Sheep','Sheep are domestic animals which are kept by farmers and herdsmen.\r\nThey have been raised by humans for a long time to gain meat and wool.\r\nThey are absolutely peaceable and live as herds in sheepfolds or\r\non pastures. However, the owners will be upset if you kill one of them.\r\nA Tibian saying states that there is a black sheep in every herd.<BR>\n<BR>Sheep have 20 hitpoints. \nIt takes 250 mana to summon or convince these creatures.\n<BR><BR>Sheep yield 0 experience points. They carry meat with them.'),(97,'sibang','Sibangs','The Sibang seems playful and harmless but this impression is misleading.\r\nThey use their incredible agility to attack enemies from a safe distance\r\nand to swiftly evade counter-attacks. Their hit-and-run tactic proves\r\nespecially effective in the familiar territory of the jungle. Attacking\r\nsuddenly from the cover of trees, they throw volleys of different\r\nprojectiles and then retreat to safety to prepare for their next attack.\r\nEver curious and adventurous, they are the apes that are most often away\r\nfrom their homes. Sometimes they serve as scouts and spies to prepare a\r\nbigger assault. Using trees like humans are using roads, it is nearly\r\nimpossible to catch them.<BR>\n<BR>Sibangs have 225 hitpoints. \nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Sibangs yield 315 experience points. They carry bananas, coconuts, gold coins, melons, oranges, small stones, and sometimes other items with them.'),(98,'skeleton','Skeletons','Skeletons are undead monsters that live in the dungeons of Tibia.\r\nIt is rumoured that they are the bodies of dead adventurers that have\r\nbeen revived by some evil power. Cropping up in packs and occasionally\r\naccompanied by other undead creatures like  ghouls, they\r\nare quite nasty opponents, particularly because they are able to drain\r\nlife energy off their opponents.<BR>\n<BR>Skeletons have 50 hitpoints. They are resistant against poison.\nIt takes 300 mana to summon or convince these creatures.\n<BR><BR>Skeletons yield 105 experience points. They carry torches, bones, hatchets, maces, brass shields, gold coins, and sometimes other items with them.'),(99,'skunk','Skunks','Legend has it there was once a race of mischievous black rodents who\r\nwere close cousins of the squirrels. They loved to fool around and to\r\ntease others all day long. However, one day they went too far. Angered\r\nby one of their tricks, a powerful fairy cursed the whole race. From\r\nthat fateful moment on, the skunks were marked with a white stripe and,\r\nmore importantly, with an overwhelming stench that was unbearable to\r\nmost creatures who live and breathe. However, it did not take the clever\r\ncritters long to work out that they could use their nauseating stench as\r\na weapon of self-defence. Today, these rodents are known as skunks, and\r\nfew creatures dare to anger them because of their feared smell.<BR>\n<BR>Skunks have 20 hitpoints. \nIt takes 200 mana to summon or convince these creatures.\n<BR><BR>Skunks yield 9 experience points. They rarely carry items with them.'),(100,'slime','Slimes','Slimes are not real creatures but very strange entities which occur\r\nin the dungeons of Tibia. They move by flowing rather than walking.\r\nTheir favourite tactic is to enclose an enemy by separating and floating\r\naround him. Their attack is quite heavy, but their defence is weak.\r\nWhen they die, they leave a poison field behind.<BR>\n<BR>Slimes have 150 hitpoints. They are resistant against poison.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Slimes yield 480 experience points. They carry nothing with them.'),(101,'smuggler','Smugglers','Although the main goal of the common smuggler is easy profit by\r\ncircumventing taxes and embargoes, or by trading forbidden goods, they\r\ndo not flinch from murdering and robbing those who find out about their\r\noperations. Smugglers can be found at hidden spots close to larger cities\r\nor in remote hideouts where they store their goods. Even though they are\r\nusually not well equipped for combat, their determination not to lose\r\nprofit makes them still opponents to be reckoned with. Only lightly\r\narmoured, they usually try to retreat if they get seriously hurt or\r\noutnumbered.<BR>\n<BR>Smugglers have 130 hitpoints. \nIt takes 390 mana to summon or convince these creatures.\n<BR><BR>Smugglers yield 144 experience points. They carry torches, gold coins, knives, leather helmets, leather legs, short swords, meat, ham, and sometimes other items with them.'),(102,'snake','Snakes','Snakes live in the grasslands and forests of Tibia where they hunt small\r\nanimals. Their tactic is to hide in the grass and pop up when a victim\r\napproaches. Relying on their poisonous bite they even attack humans\r\nwhen they feel cornered.<BR>\n<BR>Snakes have 15 hitpoints. They are resistant against poison.\nIt takes 205 mana to summon or convince these creatures.\n<BR><BR>Snakes yield 30 experience points. They carry nothing with them.'),(103,'spider','Spiders','Spiders live in the forests and dungeons of Tibia. They usually hunt\r\nsmall animals, but do not shrink back from attacking animals that are\r\nbigger than them. When they crop up in packs, they can even become\r\ndangerous for badly equipped adventurers.<BR>\n<BR>Spiders have 20 hitpoints. \nIt takes 210 mana to summon or convince these creatures.\n<BR><BR>Spiders yield 36 experience points. They carry gold coins with them.'),(104,'spitnettle','Spit Nettles','A rather strange plant of the jungle in Tiquanda is the Spit Nettle. To\r\nsome extent this plant is a sentient being that attacks everything that\r\napproaches it. Most jungle dwellers seem to have developed some strategy\r\nto coexist with that plant. Outsiders however are immediately attacked\r\nwith poisonous thorns that the nettle spits from a sack beneath its\r\nblossoms. It seems it has an endless supply of thorns and we have not\r\nheard yet of a nettle that has run out of them. It is not quite clear\r\nwhy a plant would attack in such a manner, but most likely it is some\r\nsort of self-defence that is unparalleled in the plant world. The lizard\r\npeople have cultivated that plant to defend their dwellings. So utmost\r\ncaution is advised when you encounter a colony of those plants, some\r\nangry \'gardener\' could be just around the corner.<BR>\n<BR>Spit Nettles have 150 hitpoints. They are resistant against poison and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\nIn addition, they are able to sense invisible creatures.\n<BR><BR>Spit Nettles yield 60 experience points. They carry gold coins, shadow herbs, and sometimes other items with them.'),(105,'stalker','Stalkers','Stalkers are persons that are permanently invisible. They sneak up to their\r\nvictim, and attack it suddenly. Some of these assassins have been spotted\r\nat Edron. They stab with their daggers and suck life energy out of their\r\nopponents, but if the first strike is not deadly, they are weak fighters.<BR>\n<BR>Stalkers have 120 hitpoints. \nThese creatures can neither be summoned nor convinced.\n<BR><BR>Stalkers yield 270 experience points. They carry gold coins, throwing knives, leather legs, and sometimes other items with them.'),(106,'stonegolem','Stone Golems','Stone Golems are kind of living rocks. All their limbs are out of stone,\r\nand they live on stones. They live in the dungeons of Edron, where they find\r\ntheir favourite food, granite with quartz. Normally, they are peaceful,\r\nbut they can get very angry about adventurers trampling on their food and\r\ntry to slay the intruder using their incredible power.<BR>\n<BR>Stone Golems have 270 hitpoints. They are resistant against fire and poison and cannot be paralyzed.\nIt takes 590 mana to summon or convince these creatures.\n<BR><BR>Stone Golems yield 480 experience points. They carry small stones, gold coins, and sometimes other items with them.'),(107,'swamptroll','Swamp Trolls','Swamp Trolls are a variety of normal trolls that live in the swamps\r\nin the east of Tibia. Like the other tribes of trolls, they hunt animals and\r\nseek treasures. But they are a bit stronger and they soak their\r\nclaws with the extracts of some poisonous herbs they collect in the swamps\r\nin order to envenom their opponents. So they can be quite dangerous to\r\ninexperienced adventurers.<BR>\n<BR>Swamp Trolls have 55 hitpoints. They are resistant against poison.\nIt takes 320 mana to summon or convince these creatures.\n<BR><BR>Swamp Trolls yield 75 experience points. They carry daggers, torches, leather boots, fish, gold coins, and sometimes other items with them.'),(108,'tarantula','Tarantulas','The Tarantula is another nasty variant of the spider family. It is not bound\r\nto a certain habitat, so it can be encountered in caves, forests and ruins\r\nalike. Therefore it poses a threat everywhere but in the coldest or volcanic\r\nareas. It is aggressive and dangerous and it is not choosier in its diet than\r\nin its habitat. Anything is seen as prey and sometimes they even cannibalise\r\ncreatures of their own species. Its poisonous fangs are more than enough to\r\nmake these beasts a constant threat to the settlers but many extermination\r\ncampaigns have driven them back from the centres of civilisation. Still the\r\nsight of a single Tarantula is usually enough for a town to hire some scouts\r\nand mercenaries to examine the area more closely.<BR>\n<BR>Tarantulas have 225 hitpoints. They are resistant against poison.\nIt takes 485 mana to summon or convince these creatures.\n<BR><BR>Tarantulas yield 360 experience points. They carry gold coins and sometimes other items with them.'),(109,'terrorbird','Terror Birds','The ferocious Terror Bird is a terrifying hunter that usually lives in less\r\ndense areas of the jungle. Unlike other birds, it is a huge carnivorous animal\r\nthat cannot even fly. Sages have already wondered if such an unusual creature\r\ncan be natural or if it rather has its source in evil wizardry. On the other\r\nhand, nests of Terror Birds have been found, so this theory does not seem to\r\nbe very likely. Be it as it may, the name of this feared hunter is more than\r\njustified. The aggressive bird attacks everything that comes in its sight with\r\nrage that does indeed inspire fear and dread. The carnivorous Terror Bird seems\r\nto regard everything as its rightful prey and its sharp beak often proves it\r\nright. Its inability to fly is made up by strong muscular legs that allow the\r\nbird to run at an astonishing speed and that serve also well as additional\r\nweapons.<BR>\n<BR>Terror Birds have 300 hitpoints. \nIt takes 490 mana to summon or convince these creatures.\n<BR><BR>Terror Birds yield 450 experience points. They carry gold coins, meat, worms, and sometimes other items with them.'),(110,'tiger','Tigers','The Tiger stalks through the jungle of Tiquanda, looking for its prey. It\r\nstrikes by surprise, quickly and deadly. Fast and lethal, this fighting machine\r\nis a hurricane of teeth and claws when it comes to combat. Many hunters in the\r\njungle suddenly became the hunted one when they crossed the path of this striped\r\npredator. Tigers are solitary creatures, although small Tiger families are not\r\nan uncommon view. Even though they are mostly hunting smaller mammals of the\r\njungle, sometimes they are also after larger prey. They easily feel threatened\r\nand like most warlike creatures, they react on threats with violence. Tigers\r\nare agile and fast but lack endurance for longer pursuits. Still it is unlikely\r\nthat a chosen victim manages to escape at all.<BR>\n<BR>Tigers have 75 hitpoints. \nIt takes 420 mana to summon or convince these creatures.\n<BR><BR>Tigers yield 120 experience points. They carry ham and meat with them.'),(111,'troll','Trolls','Trolls are a human-like race that lives in small tribes in the holes\r\nand dungeons of Tibia. There they hunt animals and seek treasures\r\nover which they keep a jealous watch. They are weak and silly fighters,\r\nbut as a squad they can become quite dangerous.<BR>\n<BR>Trolls have 50 hitpoints. \nIt takes 290 mana to summon or convince these creatures.\n<BR><BR>Trolls yield 60 experience points. They carry gold coins, hand axes, leather boots, leather helmets, meat, spears, wooden shields, and sometimes other items with them.'),(112,'valkyrie','Valkyries','Valkyries are the upper caste of the amazons, communities of martial women\r\nliving in the swamps in the east of Tibia. They are even stronger in close\r\ncombat and use their spears skillfully for distance fighting. Every amazon\r\nwho has proven her bravery by taking the skulls of thirteen opponents\r\nwill be promoted to a valkyrie.<BR>\n<BR>Valkyries have 190 hitpoints. \nIt takes 450 mana to summon or convince these creatures.\n<BR><BR>Valkyries yield 255 experience points. They carry chain armors, meat, gold coins, daggers, spears, skulls, and sometimes other items with them.'),(113,'vampire','Vampires','Vampires are undead creatures that live in the haunted ruins on Darama.\r\nThey are very strong, and live on blood which they suck out of their victims.\r\nDressed with long capes, which are black as night, they are hunting in\r\nthe dungeons and, at night, even on the surface. Some people actually\r\nbelieve that they are able to fly, like bats which look like small\r\nvampires. Their scaring sight and their bloodcurdling cries have already\r\nparalyzed many brave adventurers.<BR>\n<BR>Vampires have 450 hitpoints. They are resistant against poison and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Vampires yield 870 experience points. They carry bowls, gold coins, skulls, katanas, grave flowers, and sometimes other items with them.'),(114,'warlock','Warlocks','Warlocks are among the most powerful magicians of Tibia, but they do\r\ntheir research not for the benefit of mankind but only for their own\r\ninterests. Nobody, however, knows what their plans are, hiding deep in the\r\ndungeons of Tibia and attacking and killing every intruder of their sphere,\r\nso that hardly any information about them can permeate.<BR>\n<BR>Of course, warlocks know a lot of fighting spells. The can shoot fire\r\nand energy in various forms, summon stone golems as vassals, paralyze their\r\nvictims and drain mana off them. Moreover, they know how to heal themselves\r\nand how to make themselves invisible. Finally they can detect all invisible\r\nopponents.<BR>\n<BR>Warlocks have 3200 hitpoints. They are resistant against fire, poison, and energy and cannot be paralyzed.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Warlocks yield 12000 experience points. They carry candlesticks, gold coins, poison daggers, inkwells, cherries, breads, and sometimes other items with them.'),(115,'warwolf','War Wolves','War Wolves are a race of fearsome beasts bred by orcs. They are much \r\nlarger than their less dangerous cousins from which they evolved, \r\nreaching up to five feet in height, and in fact orcs often use them as \r\nmounts to ride on. However, War Wolves are dangerous opponents in their \r\nown right, endowed with awesome strength and vicious, razor-sharp teeth \r\nthat can cut through armour and flesh alike. Also, War Wolves haven \r\nproven to be so cunning in battle that some scholars believe these \r\nanimals have acquired some kind of semi-intelligence. Of course these \r\nmay only be rumours, but there can be no doubt that War Wolves hate all \r\ncivilised races just as ardently as their masters do. A War Wolf will \r\nalways fight to the death.<BR>\n<BR>War Wolves have 140 hitpoints. \nIt takes 420 mana to convince these creatures but they cannot be summoned.\n<BR><BR>War Wolves yield 165 experience points. They carry ham and meat with them.'),(116,'wasp','Wasps','Wasps are predacious insects that live in the grasslands and forests of\r\nTibia. Using their poisonous sting they attack other animals. As they\r\nare very quick it is impossible to flee from them. If you hear their\r\nthrilling buzz it is too late to escape. As their defence is quite weak\r\nyou should try to do the first strike.<BR>\n<BR>Wasps have 35 hitpoints. They are resistant against poison.\nIt takes 280 mana to summon or convince these creatures.\n<BR><BR>Wasps yield 72 experience points. They carry nothing with them.'),(117,'wildwarrior','Wild Warriors','Wild Warriors are deserters of the Royal Army. Together with other\r\ncriminals they have erected the so-called \"Outlaw Camp\". The king\'s power\r\nis too weak to reach this place, and so they feel quite safe from\r\nprosecution there. To keep up this state of lawlessness, they will attack every\r\nintruder vigorously. Equipped with heavy weapons and, due to their former\r\ntraining as soldiers well organized, they are quite powerful opponents.<BR>\n<BR>Wild Warriors have 135 hitpoints. \nIt takes 420 mana to summon or convince these creatures.\n<BR><BR>Wild Warriors yield 180 experience points. They carry gold coins, axes, maces, brass shields, leather legs, meat, and sometimes other items with them.'),(118,'winterwolf','Winter Wolves','Winter Wolves are related to normal wolves, but they have a thicker, white\r\ncoat and are a bit stronger. They live at the ice islands in the north-west\r\nof Tibia, where they hunt small animals. A single winter wolf is rather shy,\r\nbut as a pride they can be quite dangerous. And when they are hungry they\r\neven attack humans.<BR>\n<BR>Winter Wolves have 30 hitpoints. \nIt takes 260 mana to summon or convince these creatures.\n<BR><BR>Winter Wolves yield 60 experience points. They carry meat with them.'),(119,'witch','Witches','Witches are magically skilled women that usually live deep in the\r\nforests and swamps of Tibia. There they collect herbs and other ingredients,\r\ne.g. parts of dead animals, from which they brew potions in their large iron\r\ncauldrons. Rumour has it that they can fly using their brooms. Most of them\r\nare quite malicious and short-tempered and attack adventurers by casting\r\nfireballs at them, even if they are invisible.<BR>\n<BR>Witches have 300 hitpoints. They are resistant against poison and energy.\nThese creatures can neither be summoned nor convinced.\n<BR><BR>Witches yield 360 experience points. They carry wolf tooth chains, gold coins, sickles, brooms, leather boots, coats, capes, cookies, cheese, and sometimes other items with them.'),(120,'wolf','Wolves','Wolves are beasts of prey that live in the forests and mountains of Tibia.\r\nCombined in prides they hunt other animals. In grim winters they even come\r\ncloser to towns to attack herds or humans. A single wolf is a weak and shy\r\nopponent, but as a pride they can be quite dangerous.<BR>\n<BR>Wolves have 25 hitpoints. \nIt takes 255 mana to summon or convince these creatures.\n<BR><BR>Wolves yield 54 experience points. They carry meat and worms with them.');
