/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `onupdate_players` AFTER UPDATE ON `players`
 FOR EACH ROW BEGIN
	IF NEW.charname != OLD.charname THEN
		UPDATE buddy SET buddy_string = NEW.charname WHERE buddy_id = NEW.account_id;
		UPDATE houses SET owner_string = NEW.charname WHERE player_id = NEW.account_id;
		UPDATE highscores SET charname = NEW.charname WHERE highscores.account_id = NEW.account_id;
		UPDATE pg SET charname = NEW.charname WHERE pg.account_id = NEW.account_id;
	END IF;
END */;;
DELIMITER ;
