INSERT INTO `spells` VALUES ('animatedead','Animate Dead','adana mort','Summon','Rune',27,600,1200,'yes',9,'This is a very scary spell. The magicians of Edron have studied captured undead creatures for a long time in order to explore their eerie secret. Finally, they succeeded in storing some life energy in a rune. When this energy was unleashed onto a body it was found that an undead creature arose that could be mentally controlled by the user of the rune. This spell is useful to create allies in combat without having to resort to the expensive summoning spell.',5,4,1,'Edron'),('antidote','Antidote','exana pox','Healing','Instant',10,30,150,'no',15,'Few spells need as little recommendation as Antidote. It is cheap, it is fast, and it will cleanse your body from any poison, no matter how serious or aggressive it is. All adventurers should buy this extremely useful spell as soon as possible, as those who don\'t are almost certain to pay for their negligence with their lives.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('antidoterune','Antidote Rune','adana pox','Healing','Rune',15,200,600,'no',1,'In the old days, when the world was still young and people did not know the dangers of the wild, many adventurers fell prey to poisonous creatures that were roaming the caves and forests. The druids, who were skilled with all kinds of poisons, wanted to help those young adventurers that were not able to cure themselves. After many years of research they finally succeeded in altering the antidote spell so it could be bound to a rune. By using this rune it was possible to stop the effect of any known poison.<BR>Ever since then, the trusty antidote rune has saved the life of many a poisoned adventurer who found he had run out of mana just when he needed it most.',1,0,1,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('berserk','Berserk','exori','Attack','Instant',35,0,2500,'yes',2,'Handling a weapon well demands great skill and long training. The most experienced knights can perform a magically enhanced special attack that no other vocation can master. The Berserk spell enables a warrior to lash out at all enemies surrounding him with one devastating attack. The power of the attack will rise with his level, but so will the mana cost of the spell. For this reason it should be applied wisely. A knight casting the spell carelessly will find himself drained of mana in no time.',0,0,0,'Edron'),('cancelinvisibility','Cancel Invisibility','exana ina','Support','Instant',26,200,1600,'yes',8,'It is widely known that enemies who have mastered the secret of invisibility rank among the most challenging of opponents. They can corner unsuspecting adventurers or launch deadly sneak attacks from behind. Thankfully, the sages of Edron have developed an effective counterspell. By casting Cancel Invisibility, a sorcerer can reveal all hidden creatures or players in his surrounding.<BR>Please note that on non-PvP worlds, this spell will not remove the invisibility of other characters.',0,0,0,'Edron'),('challenge','Challenge','exeta res','Support','Instant',20,30,2000,'yes',2,'In the heat of battle it is crucial to distract the monsters\' attention from weaker party members. For this reason the knights, who are traditionally the best melee fighters in Tibia, have developed this remarkable spell. Whenever it is cast in combat, all surrounding monsters will be filled with blind rage and rush to attack the knight, forgetting their current targets. Many lives have been saved by this spell, but quite a number of knights have also paid their courage with their lives, so make sure you are strong enough to meet those you challenge by casting this spell. The sage Eremo teaches this spell to elite knights, who are exceptionally strong in close combat and thus predestined for using it.',0,0,0,'Eremo\'s isle'),('chameleon','Chameleon','adevo ina','Support','Rune',27,600,1300,'no',1,'This peculiar rune spell was more or less discovered by accident. Legend has it that the famous druid Ferdo the Forgetful tested a new healing spell on himself to cure his toothache, only to find that he was turned into a flowerpot! However, the metamorphosis caused by Chameleon is only superficial, and while a caster who is using the spell can take on the exterior form of nearly any inanimate object, he will always retain his original smell and mental abilities. While this proved to be good luck for Ferdo, it clearly showed the spell\'s limitations. Very few creatures and only the most distracted of intelligent beings are fooled by Chameleon, so there is no practical use for it, making this largely a fun spell. However, some of the foremost of today\'s druids are still researching the spell, so it is to be hoped that one day the spell\'s evident flaws can be removed.',2,4,1,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('conjurearrow','Conjure Arrow','exevo con','Supply','Instant',13,100,450,'no',4,'Due to the paladins\' specialisation in distance fighting adventurers of this vocation are almost always in short supply of ammunition. For this reason the high paladins have sought to push the research into the creation of ammunition by magical means. The Conjure Arrow spell was the first major breakthrough that was achieved, and it has been one of the most important entries in the paladins\' spellbooks ever since. By casting this handy spell, 10 arrows are magically created, seemingly out of thin air. The truth is, however, that the required material is magically extracted from the surrounding area.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('conjurebolt','Conjure Bolt','exevo con mort','Supply','Instant',17,140,750,'yes',4,'This spell is an alternative of the hugely popular <A HREF=/magic/conjurearrow>Conjure Arrow</A> spell. By casting it a paladin can magically extract dead wood particles and metal trace elements from his surroundings and form them into 5 deadly crossbow bolts. As this conjuring ritual is considerably more complicated than that of the <A HREF=/magic/\nconjurearrow>Conjure Arrow</A> spell, only the magical instructors at Edron\'s renowned magic academy can teach this spell to the public.',0,0,0,'Edron'),('convincecreature','Convince Creature','adeta sio','Summon','Rune',16,200,800,'no',1,'The Convince Creature rune was developed by druids who wished to find a way to befriend hostile animals rather than having to kill them. It soon turned out, however, that this rune could also be used against more powerful creatures, including some who must actually be considered to be intelligent species. Unfortuantely, to succeed in convincing a creature mana, additionally to creating the rune, has to be spent. The mental strain on the user of the rune is determined by the power of the creature he wishes to convince, so the amount of mana to convince a rat is lower than that which is needed for an orc. The adventurer who uses the rune should make sure in advance, however, that the target is really susceptible to the effect of this spell - there is no point in trying to convince a rampaging dragon. Also, the adventurer should make sure to stay close to convinced creatures to maintain the bond. Convinced creatures that are separated from their masters will soon run off, never to be seen again.',3,5,1,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('creatureillusion','Creature Illusion','utevo res ina \"creature\"','Support','Instant',23,100,1000,'no',9,'This spell was developed by druids for the specific purpose of studying wild life from within, as it were. Although they succeeded in devising an enchantment that allows the caster to take on the physical form of nearly any animate creature, the spell was in fact a failure because the metamorphosis is strictly limited to optical effects. Taking apart the appearance, the caster remains normal in any other aspect, and no special abilities such as flying or breathing fire are attained. Consequently, few creatures are fooled by Creature Illusion. However, the spell is far from superfluous, as it allows for some terrific effects on Halloween.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('desintegrate','Desintegrate','adito tera','Support','Rune',21,200,900,'yes',13,'Nothing is worse than being cornered when fleeing from an enemy you just cannot beat, especially if the obstacles in your way are items you could easily remove if only you had the time! However, there is one reliable remedy: The Desintegrate rune will instantly destroy any movable item that is in your way, making room for a quick escape. If you need to run for it and you do not have the time to smash an obstacle in your way, the Desintegrate rune is what you need. You should always make sure to have one or two in your backpack!',3,4,3,'Edron'),('destroyfield','Destroy Field','adito grav','Support','Rune',17,120,700,'no',13,'In the world of Tibia, magical fields are a common threat. Not only do many adventurers have the possibility to use field runes, but there are also a number of other conceivable causes, including traps, breath attacks by certain creatures and even perfectly natural occurrences. To be trapped by such harmful fields is an unpleasant experience most seasoned adventurers have had at some point or other. Many of them simply owe their survival to having had a couple of Destroy Field runes with them! A truly indispensable spell, this rune should not miss in any adventurer\'s backpack.',2,3,3,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('enchantstaff','Enchant Staff','exeta vis','Support','Instant',41,80,2000,'yes',8,'Some items are capable of storing energy to be used later on, while others may be magically upgraded or improved. The sorcerer\'s staff belongs to the latter class. If the Enchant Staff spell is cast onto it turns into a powerful weapon sparkling with beautiful blue energy. The effect justifies the mana that is spent, although it wears off rather quickly. Sorcerers who have promoted to master rank may learn this spell from the sage Eremo.',0,0,0,'Eremo\'s isle'),('energybeam','Energy Beam','exevo vis lux','Attack','Instant',23,100,1000,'no',8,'The Energy Beam was one of the first instant attack spells to be devised. Its development sprang from the need to allow for quick offensive magic that did not rely on the use of runes. The result of this endeavour was this handy spell which is capable of dealing massive damage in the blink of an eye. On casting this spell, a ray of concentrated energy is shot in the direction the caster is facing, electrifying all this is in its way. A clever sorcerer will use this spell in narrow passageways where his opponents have no choice but to line up.',0,0,0,'Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('energybomb','Energybomb','adevo mas vis','Attack','Rune',37,880,2300,'yes',8,'Another spell devised by the crafty sorcerers in Edron\'s magic academy, the development of the Energy Bomb was based on the trusty <A HREF=/magic/energyfield>Energy Field</A> spell. As with its weaker relative, using the Energy Bomb rune will create a field of deadly energy that deals damage to all who carelessly step into it. However, its area of effect has been greatly enhanced, now covering a full 9 square metres! Monsters that are caught in the middle of an Energy Bomb are frequently confused by the unexpected effect, and some may even stay in the field of deadly sparks for a while. Also, some daring adventurers are known to use the Energy Bomb onto themselves in desperate situations to keep their enemies from attacking them. However, for obvious reasons only the strongest or most desperate of adventurers should use energy bombs this way.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the bomb will remain active only for a few seconds.',5,10,2,'Edron'),('energyfield','Energy Field','adevo grav vis','Attack','Rune',18,320,700,'no',9,'One of the standard field runes, this spell creates a limited barrier made up of crackling energy that will cause electrical damage to all those passing through. Since there are few creatures that are immune to the harmful effects of energy this spell is not to be underestimated. In fact, rather than using the rune to block narrow passageways, many of the more inexperienced Tibians use it as a cheap offensive spell, since affected creatures suffer energy damage at least twice.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the field will remain active only for a few seconds.',2,3,3,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('energystrike','Energy Strike','exori vis','Attack','Instant',12,20,800,'yes',9,'Another spell from the trusty strike spell series, this particular version is based on energy. When cast a powerful flash of lightning strikes all unfortunate targets standing right in front of the caster. As with all other strike spells the effect of Energy Strike is instant and the damage that is caused is largely determined by the caster\'s magic skill.',0,0,0,'Edron'),('energywall','Energy Wall','adevo mas grav vis','Attack','Rune',41,1000,2500,'no',9,'Casting this spell generates a solid wall made up of magical energy. Walls made this way surpass any other magically created obstacle in width, so they are recommended for use in outside areas where there are powerful monsters to run away from. For this reason it is always a good idea to have an Energy Wall rune or two in one\'s pocket when travelling through the wilderness. However, recent studies have suggested that there may be some creatures that are capable of breaking through energy walls, so you should always be prepared for a quick escape just in case.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the wall will remain active only for a few seconds.',5,9,4,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('energywave','Energy Wave','exevo mort hur','Attack','Instant',38,250,2500,'no',8,'A variation of the popular <A HREF=/spell=energybeam>Energy Beam</A>, casting this spell causes a cone of energy to unfold in front of the caster that inflicts considerable damage to all unfortunate creatures that are hit. Due to its peculiar form it is especially useful when used in closed spaces or against fleeing enemies. Like its relative, the Energy Wave spell is not bound to a rune, requiring the sorcerer to invest mana at the point of time when it is cast. Although the cost is substantial the comparatively large area of effect and the amount of damage that is caused usually justify using the spell.',0,0,0,'Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('envenom','Envenom','adevo res pox','Attack','Rune',21,400,1000,'yes',1,'The druids, who over the centuries have developed undisputed mastery of all kinds of poisons, devised this nasty rune spell as an effective weapon to be used in combat. Whenever the rune is used a powerful poison is injected into the target\'s veins, causing it to slowly wither away and die. Only resistance to poisons or a quickly cast <A HREF=/magic/antidote>Antidote</A> spell will be able to save the victim of a cruel, untimely death. Of course, the spell is hardly suited to bring down an opponent within seconds, but if it is used in a clever, thought-out manner it can be a terrible weapon indeed.',2,4,1,'Edron'),('explosion','Explosion','adevo mas hur','Attack','Rune',31,720,1800,'no',9,'The Explosion rune is somewhat unusual. It must be aimed at areas rather than at specific creatures, so it is possible for explosions to be unleashed even if no targets are close at all. For this reason the effective use of the rune requires some skill. Thankfully, however, explosions cause damage within a substantial blast radius, so the experienced adventurer will know when and how to use this spell to achieve optimal results.<BR>In spite of its tricky handling Explosion is still an immensely popular spell as it deals considerable physical damage and because it is the most powerful attack spell druids can bind into runes. Also, the Explosion spell is especially popular with experienced knights who often use the rune in the heat of the battle to cause additional damage to tough opponents.',4,6,3,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('explosivearrow','Explosive Arrow','exevo con flam','Supply','Instant',25,290,1000,'no',4,'The result of tedious studies by Tibia\'s foremost paladins, this spell is used to create fiery ammunition which explodes when hitting a target. It has to be said that this spell has never fully lived up to its creators\' expectations, as the magical nature of the explosions requires the skilled hand of an experienced spell caster to reach its full destructive potential. This resulted in the paradoxical situation that explosive arrows are usually far deadlier in the hands of sorcerers and druids than in those of a paladin. But while this came as a disappointment to many, the clever paladins quickly realised that a lot of money could be made this way. Today, many paladins make a pretty gold coin by selling their explosive arrows to experienced sorcerers or druids.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('findperson','Find Person','exiva \"name\"','Support','Instant',8,20,80,'no',15,'Another cheap, but useful spell that is highly popular with all vocations, Find Person will allow the caster to locate the life essence of any character that is currently online. Unfortunately, it is not possible to identify the exact whereabouts due to the complexity of this ritual. Rather, the caster will only learn the general direction in which the targeted character can be found. For this reason it may be necessary to cast the spell a couple of times before you will meet the character you are looking for.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('fireball','Fireball','adori flam','Attack','Rune',17,160,800,'no',13,'Without any doubt Fireball is one of the most common attack runes there are in Tibia. Ever since its spell was developed by a joint research team made up both of druids and of sorcerers, this reliable rune has proven its worth in countless battles. When it is used a massive fiery ball is released. The blast can cover an area of up to 21 square metres, making this a perfect rune to spread havoc among whole crowds of opponents. This way, a skilled user armed with a couple of these runes can take on a little army on his own. However, he should make sure that his opponents are susceptible to fire, as creatures that resist fire well can easily shake off the spell\'s effects.<BR>Today, the Fireball spell has somewhat lost in attractiveness since an improved version, the <A HREF=/magic/greatfireball>Great Fireball</A>, was released. However, the traditional Fireball spell is still common due to its lower mana and magic level requirements.',2,2,2,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('firebomb','Firebomb','adevo mas flam','Attack','Rune',27,600,1500,'no',9,'A cunning combination of the <A HREF=/magic/fireball>Fireball</A> and <A HREF=/magic/firefield>Fire Field</A> spells, this rune is a deadly weapon in the hands of the skilled user. On releasing it an area of 9 square metres is covered by searing flames that will scorch all those that are unfortunate enough to be caught in them. Worse, many monsters are confused by the unexpected blaze, and with a bit of luck a caster will even manage to trap his opponents by using the spell. However, caution is needed since most of the more determined monsters or creatures will not be held back by the flames for long.<BR>Some daring adventurers are known to have used Fire Bomb runes onto themselves in desperate situations to keep their enemies from attacking them. However, for obvious reasons only the strongest or most desperate adventurers should use fire bombs this way.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the bomb will remain active only for a few seconds.',4,5,2,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('firefield','Fire Field','adevo grav flam','Attack','Rune',15,240,500,'no',9,'One of the earliest spells ever to be developed, this is a reliable, no-nonsense field spell that is based on fire. When the rune is used a field of approximately one square metre is covered by searing fire that will last for some minutes, gradually diminishing as the blaze wears down. As with all field spells, Fire Field is quite useful to block narrow passageways or to create large, connected barriers. Placing the field on an opponent is also a strategy that will work well with weaker monsters, although most stronger creatures will easily shake off the effect.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the field will remain active only for a few seconds.',1,1,3,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('firewall','Fire Wall','adevo mas grav flam','Attack','Rune',33,780,2000,'no',9,'The Fire Wall spell is one of the oldest known enchantments, and it has proved its worth on countless occasions. It offers reliable protection against all creatures that are afraid of fire, and many an adventurer who travels through the wilderness uses these runes to make sure he gets some undisturbed rest. The exceptionally long duration of the spell as well as the possibility to form massive barriers or even protective circles out of fire walls make this a versatile, practical spell that should not miss in any druid\'s or sorcerer\'s spellbook.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the wall will remain active only for a few seconds.',4,6,4,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('firewave','Fire Wave','exevo flam hur','Attack','Instant',18,80,850,'no',8,'This was one of the very first spells ever to be created. Impressed by the destructive power of dragon fire, some of the foremost sorcerers agreed to cooperate in order to develop a spell that would resemble the magical flames both in spatial extent and in destructive potential. The result was an instant spell that causes streams of searing fire to shoot from the caster\'s hand which unfold into massive cones as they go along. While the fire created this way never really matched its model in its sheer destructive effect, the spell is still capable of wreaking havoc among those that are hit, especially if the caster manages to direct the fire wave right into the middle of a group of enemies. However, the caster should be careful not use this spell too liberally in order to avoid serious mana drain.',0,0,0,'Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('flamestrike','Flame Strike','exori flam','Attack','Instant',12,20,800,'yes',9,'Realising there was a need for cheap, precise attack magic the sorcerers at Edron\'s magic academy came up with a series of simple strike spells that combined low mana cost with instant casting capability and solid, reliable performance. This particular version is based on the element of fire. When it is cast a vicious flame lashes out from the ground, scorching all targets standing right in front of the caster.',0,0,0,'Edron'),('food','Food','exevo pan','Supply','Instant',14,120,300,'no',5,'Food plays a crucial role in Tibia, as both the healing of wounds and the regeneration of mana require a well-filled stomach. In fact, many a daring adventurer who ventured deep into some dreary dungeon lost his life because he forgot to bring along food. However, with this handy spell in your book you never need to worry, even if you are shipwrecked on a deserted island or stuck in a lightless cave. Simply cast Food and you will receive one or two random delicacies that will help you carry on.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('forcestrike','Force Strike','exori mort','Attack','Instant',11,20,600,'yes',9,'Force Strike belongs to a series of strike attack spells that combine low mana cost with reliable, instantaneous performance. When cast all targets standing right in front of the caster are struck by a blow of magical force that causes considerable damage. The extent of the wounds that are inflicted is largely determined by the caster\'s skill, making this an impressive spell when used by an experienced sorcerer or druid.',0,0,0,'Edron'),('greatenergybeam','Great Energy Beam','exevo gran vis lux','Attack','Instant',29,200,1800,'no',8,'The <A HREF=/magic/energybeam>Energy Beam</A> continues to be a favourite among sorcerers. For this reason, a lot of research has gone into the spell to make it even more effective. The Great Energy Beam was the result of these endeavours. It is very similar to the original spell in appearance and in the way it is used, but its effect has been greatly improved. Of course, better performance comes with a price: The mana cost of the Great Energy Beam spell is considerably higher than that of its lesser relative.',0,0,0,'Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('greatfireball','Great Fireball','adori gran flam','Attack','Rune',23,480,1200,'no',9,'As may be taken from the title, the Great Fireball is basically an improved version of the trusty <A HREF=/magic/fireball>Fireball</A> rune. Developed in close cooperation between sorcerers and druids, the Great Fireball features both increased damage and a considerably enlarged blast radius, typically covering an area of up to 37 square metres! This way any average sized room is easily filled with the searing blaze, scorching all creatures that are in it except for the rune user himself. It stands to reason that the Great Fireball is a favourite of most Tibians, as it is well suited both to hit whole crowds of monsters and individual targets that are difficult to hit because they are fast or hard to spot. There are few adventurers who do not cherish those moments of silent glory when they have just brought down a whole crowd of enemies with a single Great Fireball. Still, due to the large blast radius the users are well advised not to be too trigger happy with this rune to make sure no friend is near when it is used.',3,4,2,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('greatlight','Great Light','utevo gran lux','Support','Instant',13,60,500,'no',15,'While the common light spell is usually quite sufficient under normal conditions, it was still widely agreed that a brighter and longer lasting light was desirable, as many of the more challenging dungeons are dreary places that require careful examination in order to prevent ambushes or other unpleasant surprises. The Great Light spell was developed to meet these demands. Because of its practical use it was made available to all vocations in Tibia.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('haste','Haste','utani hur','Support','Instant',14,60,600,'yes',15,'Life in Tibia is dangerous, and all adventurers must live with the disquieting certainty that the next fight may be their last. For this reason the crafty sorcerers and druids are constantly looking for new ways to assist the Tibian heroes and to guarantee their survival. This spell was one of the more uncommon solutions they have found. Starting from the thought that to survive a battle means to live to fight another day, the researchers developed it to help adventurers to escape from fights they cannot win. Using their excellent medical and anatomical knowledge, the druids found a way to magically generate powerful adrenaline rushes which allow the caster to perform superhuman feats for short periods of time, allowing them to outrun most common creatures. It has to be said that some reckless sorcerers proposed a different approach which was actually based on the manipulation of time itself. This approach, however, was quickly dismissed by the wise council at Edron\'s magic academy, since it posed imponderable risks. Unfortunately, however, these studies were carried on in secrecy. Later on, they led to the creation of the more powerful, but dangerously unstable <A HREF=/magic/stronghaste>Strong Haste</A> spell.',0,0,0,'Edron'),('healfriend','Heal Friend','exura sio \"name\"','Healing','Instant',18,70,800,'yes',1,'Heal Friend is an instant spell that allows a caster to magically heal other characters. When cast it causes powerful healing magic to be infused into the target, quickly closing wounds and stopping bleedings. Needless to say, this is a very useful spell to be used during combat, and a strong fighter who is supported by a druid casting this spell is very difficult to overcome indeed. However, keep in mind that the caster must not move too far away from the designated target for the spell to work. Moreover, only druids are capable of performing the complex channelling ritual that is required to transfer the healing energy into living targets.',0,0,0,'Edron'),('heavymagicmissile','Heavy Magic Missile','adori gran','Attack','Rune',25,280,1500,'no',13,'Heavy Magic Missile is perhaps the standard attack spell rune in Tibia. As with its lesser relative, the <A HREF=/magic/lightmagicmissile>Light Magic Missile</A>, this spell is bound onto blank runes which may be used up to five times each in order to hurl massive balls of concentrated magical energy at one or several opponents. A true classic that should not miss in any spell caster\'s book, Heavy Magic Missile is popular both with beginners and with masters of sorcery alike as the damage that is inflicted is largely determined by the caster\'s skill and experience, making this an economical, reliable attack spell. Keep in mind, however, that there are a number of creatures that are immune to the damaging effect of magical energy.',2,4,5,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('intensehealing','Intense Healing','exura gran','Healing','Instant',11,40,350,'no',15,'Ever since their revolutionary discovery of magic that was capable of healing wounds and injuries, the druid researchers have been looking for ways to improve and to perfect this magic. The Intense Healing spell was a major step forward in these efforts. Its healing effect easily surpasses that of the common healing spell, and for obvious reasons the spell gained immediate and lasting popularity. <s>Unfortunately, the spell\'s complexity is way above the knights\' limited grasp of magic, so adventurers of this class cannot master this spell.</s><BR>Admittedly, Intense Healing is not as frequently cast today because its successor, the <A HREF=/magic/ultimatehealing>Ultimate Healing</A> spell, provides even better healing, but it is still commonly used among less experienced adventurers as well as among skilled spell casters who know how to make the most of the spells they cast.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('intensehealingrune','Intense Healing Rune','adura gran','Healing','Rune',15,240,600,'no',1,'This rune was the first result of the druids\' efforts to bind their healing magic into spell runes. The primary aim was to give a greater measure of independence to the valorous knights whose poor magic skills rarely sufficed to heal the wounds they received in battle. However, there was a need for readily available healing magic among all vocations, as there was always the danger of running out of mana in dangerous situations. For this reason the Intense Healing Rune was hailed as a big achievement by all Tibian adventurers, and it was soon found in every adventurer\'s backpack. Today, however, the rune is no longer as popular, since it was replaced by the much more efficient <A HREF=/magic/ultimatehealingrune>Ultimate Healing Rune</A>. However, it is still commonly used by young adventurers who are not skilled enough yet to use the famous blue runes. Also, since the rune\'s effectiveness is determined by the user\'s magic skill it is still popular among experienced spell casters who use it to get effective healing magic at a cheap price.<BR>Please note that on non-PvP worlds, the rune has no effect on wild creatures.',2,1,1,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('invisible','Invisible','utana vid','Support','Instant',35,440,2000,'no',13,'Despite its obvious potential, the Invisible spell\'s attractiveness is somewhat diminished by the fact that many creatures as well as most experienced adventurers are capable of perceiving the subtle traces left by its magic, thus being able to effectively see through the spell. However, most minor creatures in Tibia are still fooled by the spell\'s effect, giving the skilled caster who knows how to cast Invisible an invaluable advantage over such opponents. The life of many a sorcerer who was surprised by a hostile crowd has been saved by this spell, but it is also highly recommended for daring explorers who like to delve into unknown dungeons.<BR>Although Invisible is not a rune spell, knights can profit of the same effect by wearing a stealth ring.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('levitate','Levitate','exani hur \"up|down\"','Support','Instant',12,50,500,'yes',15,'A variation of the <A HREF=/magic/magicrope>Magic Rope</A> spell, Levitate allows the caster to swiftly move onto suitable obstacles without having to climb stairs or to use ramps. The practical value of this spell is far greater than may be readily apparent, as large obstacles are a daily nuisance to the exploring adventurer. Besides, the spell is quite useful to make a quick escape in case of danger, as creatures usually abandon pursuit if their enemy moves onto higher terrain. When casting this spell you should not forget to add the necessary parameter \"up\" or \"down\" to specify whether you want to move upwards or downwards.',0,0,0,'Edron'),('light','Light','utevo lux','Support','Instant',8,20,100,'no',15,'Light is one of the most basic spells in Tibia, and it is available to all vocations. By using it the caster will activate the inherent magic energy of his immediate surrounding to provide him with decent illumination for about ten minutes. While it is hardly brighter than your average torch, it is always good to have this spell in the book in case you are stuck in a deep dungeon and run out of non-magical light sources.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('lighthealing','Light Healing','exura','Healing','Instant',9,25,170,'no',15,'Even though the salutary effect of this spell is limited, its development represented a major breakthrough in spell research. For the first time, adventurers could quickly heal their own wounds and injuries, significantly increasing their chances to survive the dangers they are daily confronted with. Light Healing is still a very popular spell because its mana cost is reasonable and all vocations are capable of mastering it. Knights particularly rely on it since it is the only instant healing spell that is available to their vocation.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('lightmagicmissile','Light Magic Missile','adori','Attack','Rune',15,120,500,'no',13,'The Light Magic Missile spell is usually the first attack rune spell to be found in a beginner\'s spellbook. By casting it onto a blank rune in his hand, the caster will create a beautiful green rune that can be used up to five times against an opponent. The Light Magic Missile itself is an energy blast that will cause moderate damage on the target.<BR>Spell casters usually abandon this spell as soon as they are capable of creating the more powerful <A HREF=/magic/heavymagicmissile>Heavy Magic Missile</A> runes. However, as the damage caused by the rune is determined by the skill of its user, the Light Magic Missile rune can cause surprising damage in the hands of an expert caster.',1,0,5,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('magicrope','Magic Rope','exani tera','Support','Instant',9,20,200,'yes',15,'This simple though clever spell has been hailed as a great achievement by many adventurers. When used the caster is carried instantly upwards through any opening in the ceiling without having to use a rope. Needless to say, however, the caster must be placed underneath a suitable hole in the ceiling for the spell to work. This spell is immensely useful when exploring unknown dungeons as it can be used to escape quickly in case there is danger.',0,0,0,'Edron'),('magicshield','Magic Shield','utamo vita','Support','Instant',14,50,450,'no',13,'The study of magic is a time-consuming activity that requires many years of dedicated research and academic work. For this reason those who have chosen the path of magic usually neglect physical exercise, training their minds rather than their bodies. As a result, spell casters are typically frail and cannot endure injuries the way skilled warriors can. However, sorcerers and druids reacted to this problem in their typical manner, looking for magical means to protect their weak bodies in battle. The Magic Shield spell was the result of this research. By casting this spell it is possible to deflect any physical or magical damage by using sheer will power. Unfortunately, however, the mental strain caused by the spell is tremendous, and any damage that is deflected by the magical shield is directly taken from the caster\'s mana reserve. For this reason the spell should be used wisely. While there is little point in using it against weak monsters, Magic Shield has saved the life of many a spell caster when battling strong monsters that otherwise would have killed him in a second.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('magicwall','Magic Wall','adevo grav tera','Support','Rune',32,750,2100,'yes',8,'This spell causes all particles that are contained in the surrounding air to quickly gather and contract until a solid wall is formed that covers one full square metre. The wall that is formed that way is impenetrable to any missiles or to light and no creature or character can walk through it. However, the wall will only last for a couple of seconds before it evaporates just as though it had never existed. It is always a good idea to have a magic wall rune or two in your backpack in case you are chased by a monster you just cannot hope to defeat.',5,9,3,'Edron'),('masshealing','Mass Healing','exura gran mas res','Healing','Instant',36,150,2200,'yes',1,'Although this spell cannot restore as many hit points as certain other spells, it can still be considered to be the most powerful of all healing spells since its effect is not limited to a single target. Instead, every creature that is within the considerable range of effect of the caster will be healed. However, due to the large mental strain the mana cost of this spell should not be underestimated. Also, the druid should keep in mind that this spell will affect all targets, including any enemy that is within range! For this reason it is best to use the spell after combat when all opponents are slain and many members of the druid\'s party needs quick, effective healing.<BR>Please note that on non-PvP worlds, this spell has no effect on wild creatures.',0,0,0,'Edron'),('paralyze','Paralyze','adana ani','Support','Rune',54,1400,1900,'yes',1,'The Paralyze spell was devised by the legendary druid Arthiniel the Absent-minded. Having extensively researched the arcane art of alchemy, a field of traditional expertise of all druids, Arthiniel found a way to instantly solidify fluids by using magic. Looking for a practical application for his discovery, Arthiniel managed to bind the spell into a rune that could be used against an unsuspecting opponent in combat. The effect of the spell causes the target\'s blood to thicken, leaving him paralyzed and unable to fight or escape unless the effect has worn off.<BR>Today, the spell is rarely being used because it has a number of drawbacks. For instance, its effect can easily be broken by any form of healing magic, and quite a number of Tibia\'s monstrosities are simply immune to it. Worse, Paralyze requires the massive use of mana both during the creation of the rune and during its application, making this an uncommonly expensive spell. However, despite these disadvantages the spell has obvious potential since it is almost sure to buy its user precious time in combat.',3,18,1,'Edron'),('poisonbomb','Poison Bomb','adevo mas pox','Attack','Rune',25,520,1000,'yes',1,'Another product of the druids\' continual research into poisons, this rune represents an advancement of the <A HREF=/magic/poisonfield>Poison Field</A>. Like its lesser relative, the rune causes an area to be contaminated with toxic gas that will poison anybody who is caught within it. However, the area of effect of the rune has been improved - now a full 9 square metres are contaminated. Conceivable applications include the blocking of areas or the combat against fast-moving or invisible targets. Keep in mind, however, that there are a number of creatures that are immune to poison.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the bomb will remain active only for a few seconds.',2,4,2,'Edron'),('poisonedarrow','Poisoned Arrow','exevo con pox','Supply','Instant',16,130,700,'no',4,'Having found the magical means to conjure arrows for their bows, the paladins continued their efforts to create more sophisticated ammunition. The Poisoned Arrow spell was one of the results of this painstaking research. Developed with the help of experienced druids who shared their knowledge on all kinds of toxins with the paladins, the poisoned arrow is basically a regular arrow imbued with powerful venom. This makes the missile altogether more effective and pretty easy to use - simply hit your enemy anywhere, then hide and watch him fade away! Unless the creature you have hit is immune it will slowly take damage and perhaps even die from the poison. The Poisoned Arrow spell is recommended even though it requires more mana than the regular <A HREF=/magic/conjurearrow>Conjure Arrow</A> spell.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('poisonfield','Poison Field','adevo grav pox','Attack','Rune',14,200,300,'no',9,'After careful study of the existing varieties, the druids came up with this contribution to the field spell arsenal. Making use of their pre-eminent knowledge of all kinds of toxins they devised a way to create small pockets of poison gas which remain stable for several minutes before dissipating. Anybody who enters these fields will be affected by a vicious toxin. Consequently, many creatures will avoid them, although strong monsters or creatures that are immune to poison will not hesitate to move into them. Still, the spell is usually well suited to create protective barriers. Also, its usefulness as a cheap attack spell to be cast on weaker creatures must not be underestimated.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the field will remain active only for a few seconds.',1,0,3,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('poisonstorm','Poison Storm','exevo gran mas pox','Attack','Instant',50,600,3400,'yes',1,'The research into lethal poisons has a venerable tradition among druids, and over the centuries a number of corresponding spells have been devised. Not all of them are as wholesome as the famous <A HREF=/magic/antidote>Antidote</A> spell, though. In fact, druids have specifically trained the use of poisons in combat. The Poison Storm represents the ultimate achievement of this research. Developed by the notorious Tharolus the Toxic, some 200 years ago, this spell is now the most powerful weapon in the druid\'s arsenal. Whenever it is cast a huge cloud of deadly poison gas is instantly created around the druid, and any living creature that is unfortunate enough to be hit by the spell will be affected by the vicious toxin. Only the immunity to poisons or an <A HREF=/magic/antidote>Antidote</A> spell will allow a victim to survive the effects of the vicious poison. All druids who are thinking about using this spell should be careful, though, because of its massive range of effect and its substantial mana cost.',0,0,0,'Edron'),('poisonwall','Poison Wall','adevo mas grav pox','Attack','Rune',29,640,1600,'no',9,'The poison wall rune is probably the most basic of all wall spells, and it is frequently the first one to be studied by those who have just taken up the study of magic. When this rune is used a wall of concentrated toxic fumes is created which inflicts a moderate poison on all those who are foolish enough to enter it. The effect is usually impressive enough to discourage monsters from doing so, although few of the stronger monstrosities that walk the land will hesitate if there is nothing but a poison wall between them and their dinner. For this reason it is advisable not to completely rely on this rune for protection, although there is no doubt that a clever adventurer can put it to use quite often.<BR>Please note that on non-PvP worlds, this spell has no damaging effect on other characters and that the wall will remain active only for a few seconds.',3,5,4,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('powerbolt','Power Bolt','exevo con vis','Supply','Instant',59,800,2000,'yes',4,'The power bolt is an improved version of the regular crossbow bolt that has been magically optimised for penetrating power and deadliness. The amount of mana that is required for this spell is considerable and each time it is cast only one of these mighty bolts is created, but the amazing efficiency of these bolts still makes them a favourite of all skilled paladins.<BR>Only the sage Eremo knows the secret of power bolts, but he will share his knowledge with every royal paladin who is willing to pay the right amount of cash.',0,0,0,'Eremo\'s isle'),('soulfire','Soulfire','adevo res flam','Attack','Rune',27,600,1800,'yes',9,'Soulfire is an immensely evil spell as it directly targets a creature\'s very life essence. When the rune is used on a victim its soul is temporarily moved out of its body, casting it down into the blazing fires of hell itself! Needless to say, the process is immensely painful, and the wounds that are inflicted to the target are quite real. Note that the experience and the mental strength of the caster influence the damage that is caused. In the hands of an experienced user the Soulfire rune can become a fearsome weapon indeed.',3,7,2,'Edron'),('stronghaste','Strong Haste','utani gran hur','Support','Instant',20,100,1300,'yes',9,'Another advancement of a well-known spell, Strong Haste works quite similar to its lesser relative, although the effect is much more impressive. However, all potential users should be warned: The use of this spell is not without risk. In fact, it was kept secret for a long time as many worried sorcerers warned of the dangers that might be involved in carelessly tampering with time itself. In the end, however, the spell was made public by some reckless sorcerers at Edron\'s magic academy, and so it is commonly available today. Still, it is advised to resort to this spell only in the most desperate of situations where nothing but fast flight can guarantee survival.',0,0,0,'Edron'),('suddendeath','Sudden Death','adori vita vis','Attack','Rune',45,880,3000,'no',8,'The name of this spell and the ominous skull and crossbones on the runes say it all. Fast and deadly, the sorcerers\' widespread reputation of gruesome efficiency in combat is largely based on this devastating spell. Nearly no other spell can compare to Sudden Death when it comes to sheer damage. For this reason it is immensely popular despite the fact that each rune may only be used once and that only a single target is affected. In fact, most sorcerers and druids and quite a number of skilled paladins always have a couple of Sudden Death runes in their backpacks in case of an unexpected ambush. However, a wary adventurer will not blindly rely on his Sudden Death runes to save him in any position. Since the damage caused by the rune is of physical nature, it is possible that a well armoured enemy will take much less damage from it than a vulnerable target.',5,15,1,'Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('summoncreature','Summon Creature','utevo res \"creature\"','Summon','Instant',25,0,2000,'no',9,'By casting Summon Creature druids and sorcerers can call creatures to their sides that will do their bidding. This is a mysterious and demanding spell which to this day is not fully understood in many details, and for this reason there are many limitations. Thus, only certain creatures may be summoned, and no summoner has ever managed to control more than two creatures at a time. What is generally agreed upon, however, is that the mental effort that is necessary to summon a creature is determined by the summoned being\'s strength, so if a strong creature is conjured a lot of mana is required. Also, it has turned out that monsters may only be controlled within a certain radius. If a creature is left behind by its summoner it eventually disappears as the artificial bond that kept it in the world is broken.<BR>Needless to say, the spell is widely popular among spell casters, as summoned creatures can be used for a wide variety of tasks.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('ultimateexplosion','Ultimate Explosion','exevo gran mas vis','Attack','Instant',60,1200,8000,'yes',8,'Like the name indicates, this spell is the ultimate weapon in the sorcerer\'s arsenal. By tapping the most inner forces of the universe sorcerers can unleash frightful explosions that surpass all other spells in their devastating effect and their range of effect. The raw destructive power of the Unlimited Explosion spell is such that it can instantly kill all but the most powerful of creatures that are caught within its enormous blast radius. For this reason it must be used with extreme caution. More than one well-meaning sorcerer accidentally fried his own party members. Worse, the enormous physical and mental strain will leave the sorcerer crippled and drained of mana. A badly placed Ultimate Explosion spell could well be the last thing a sorcerer does before being torn apart in combat.<BR>Due to the high mana requirements only the most proficient of sorcerers can master this spell. It is available in Edron\'s famous magic academy.',0,0,0,'Edron'),('ultimatehealing','Ultimate Healing','exura vita','Healing','Instant',20,160,1000,'no',13,'This spell was invented by one of the very first druids, and to this day it represents one of the ultimate achievements in salutary magic. By using it a skilled spell caster can heal the worst of injuries in the blink of an eye, instantly recovering even if he was mortally wounded just seconds ago. Eager to share their knowledge and to bring good into the world, the druids gave this spell to the sorcerers and eventually even to the paladins, but they quickly started to bitterly regret this step, for the improved methods of self-healing only led many to be even more careless with their own lives and with those of others. Thus, while the spell saved countless lives over the centuries, it paradoxically also caused the loss of many others. Nonetheless, it is a crucial spell that should not miss in any druid\'s, sorcerer\'s or paladin\'s spellbook.',0,0,0,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Kazordoon, Port Hope, Thais, Venore'),('ultimatehealingrune','Ultimate Healing Rune','adura vita','Healing','Rune',24,400,1500,'no',1,'The coveted Ultimate Healing rune is an all-time favourite among all vocations, although it is held in special esteem by the knights who usually rely on runes to heal the wounds they receive in battle. No other healing enchantments that are bound into runes can compare to its salutary effect, making this perhaps the most sought-after spell rune in the world of Tibia. For this reason the secret knowledge of how to create these precious runes is jealously guarded by the druids, who often make tremendous amounts of money by selling them to adventurers of other vocations.<BR>Please note that on non-PvP worlds, the rune has no effect on wild creatures.',3,4,1,'Ab\'Dendriel, Ankrahmun, Carlin, Darashia, Port Hope, Thais, Venore'),('ultimatelight','Ultimate Light','utevo vis lux','Support','Instant',26,140,1600,'yes',9,'Like the name says, this spell represents the ultimate achievement in illuminating magic. After centuries of painstaking research the wizards at Edron\'s magic academy have finally succeeded both in extending the <A HREF=/magic/greatlight>Great Light</A> spell\'s duration and its intensity to create a whole new enchantment that is almost literally capable of turning night into day. Except for those creatures that possess the uncanny ability to turn themselves invisible, no evil creature should ever be able to catch you by surprise if you have cast Ultimate Light.',0,0,0,'Edron'),('undeadlegion','Undead Legion','exana mas mort','Summon','Instant',30,500,2000,'yes',1,'This evil spell is gruesome indeed. Like <A HREF=/magic/animatedead>Animate Dead</A>, its lesser relative, this is a necromantic spell that causes bodies of the slain to rise and serve the caster. However, rather than raising a single skeleton Undead Legion will animate all bodies that are lying in the vicinity, calling a little army to the caster\'s side in an instant. But even though this may be just what it needs to turn a tough battle any caster should be aware of the negative effects this spell may have on his own soul.<BR>Only druids are able to cast this unholy spell as they are the only vocation that has sufficient understanding of the complex workings of life and death that is needed to master it.',0,0,0,'Edron'),('wildgrowth','Wild Growth','exevo grav vita','Support','Instant',27,220,2000,'yes',1,'Druids, the traditional wardens of nature and of all that is alive, have come to master the growth of plants. This spell is one of the results of this secret knowledge. By calling upon nature a skilled druid can cause all seeds that are lying dormant in his surrounding to quickly sprout and grow into full-sized plants, thus forming an impenetrable thicket. Unfortunately, plant life created this way is short-lived and will collapse within minutes, so the magically created obstacle will not last long. Still, this spell can be quite useful to block a monster you cannot hope to defeat, thus giving you valuable time to make your escape.<BR>The sage Eremo teaches this spell to all druids who have shown their dedication to nature and to life by promoting to the rank of elder druid.',0,0,0,'Eremo\'s isle');
